9 19:27:43.000000','mark'),(301,'7801','有这么神吗？','李志光','2010-12-10 00:11:54.000000','mark'),(302,'7801','应该是那个排插的质量不好，没有接地。有的笔记本电脑电源在没有地线的情况下，网卡会受干扰。','郑锐江','2010-12-11 10:18:47.000000','mark'),(303,'7801','一般笔记本的电源滤波都做得可以的，遇上这种问题真让人纠结啊','李志光','2010-12-12 00:41:44.000000','mark'),(304,'7880','会不会接楼层交换机的水晶头插不稳？之前我也碰到过，不是电脑设置或中毒问题，最后看了楼层交换机那里，果然水晶头插不稳，有点松，之后就好了。小弟献丑，略发愚人之见。','许旭健','2011-03-01 19:38:55.000000','mark'),(305,'7908','啊，怎么这么奇怪？我也碰到好像类似的问题，线路，ip和物理地址等等核对没错，就是显示“无法识别的网络”，真晕!难道校园网账号会出问题。','许旭健','2011-03-02 21:13:12.000000','mark'),(306,'7898','如此神奇！为什么修改物理地址后就可以了呢？不知道把原有的宽带连接删了，重新建一个有没有效？','许旭健','2011-03-05 12:46:34.000000','mark'),(307,'7950','这种问题有时是楼层交换机的问题，我觉得我们可以多加考虑','许旭健','2011-03-06 11:50:34.000000','mark'),(308,'7967','额 你们说的那个人是我。。。但是我那电脑ip啥的都是自动获取的 网卡物理地址也早就改回来了 应该不是这个问题。。。','王曦','2011-03-08 22:00:33.000000','mark'),(309,'7967','也有可能不是你和她冲突，你可以试下让她禁用本地连接（这时你电脑是联网状态），再启用，看看冲突不？如果冲突，你禁用后她启用，看看是否还冲突。。如果不是你，就去帮她查。','郑锐江','2011-03-11 08:13:41.000000','mark'),(310,'7999','我之前也有去过8406，那时是跟8402报修的，那次去的时候两间宿舍都说好了。而且上个周末又跟你们去了一趟，8406的说她老是会跟8402一起断网，然后又一起突然好了。有可能是这两位同学主线在楼层交换机那里有时就形成了环路吧。','许旭健','2011-03-15 18:23:06.000000','mark'),(311,'8000','对呀对呀！我上去还被人莫名的藐视了几秒。。。就是没有ip冲突。。。','王曦','2011-03-15 22:47:11.000000','mark'),(312,'8005','哈哈！facebook=非死不可！','许旭健','2011-03-22 18:56:59.000000','mark'),(313,'8028','查冲突的MAC','周斌','2011-03-28 09:57:23.000000','mark'),(314,'8028','问题是，叫他室友问他开机，他不让开机啊。。','郑锐江','2011-03-28 22:28:37.000000','mark'),(315,'8076','学习了，强悍！','郑锐江','2011-04-22 18:06:41.000000','mark'),(316,'8078','我写详细点吧：1、2号灯不亮，拆了模块，重打一遍线，还是一样。怎么看模块是否坏了呢？既然是1、2号灯不亮，那么如果是模块问题，那就是对应白橙、橙的地方接触不良或损坏。把白棕7、棕8跟白橙1、橙2的线序对应调换，果然这边接测线仪主机，变成123456亮，78不亮，那就证明这边的模块没问题了。其他的可能就是对面模块的问题或者是墙里面的线的问题，对面的床不好搬开，直接在对面的网线的水晶头给它打成白棕、棕、白绿、蓝、白蓝、绿、白橙、橙的线序，跟其对面的模块的线序一样。（要测模块是否坏掉？可以采取另一种方法：自己做一条网线，一边打了水晶头，一边不打，大道拆出来的模块去，模块再接另一条正常的网线，用测线仪测这条线路即可。）','许旭健','2011-04-24 22:31:46.000000','mark'),(317,'8078','不好意思写错了字。应该是“一边打了水晶头，一边不打，打到拆出来的模块去”','许旭健','2011-04-24 22:34:22.000000','mark'),(318,'8121