4-22 18:10:04.0000000','周锦龙,李斯鸿,祁有盛,任文涛,章柳洵,高海浪,','周锦龙',2,'3层双号及4层一些房间上不了网，表现为可以连通到网络，但打不开网页','<P>三层大面积上不了网，可能是某间宿舍的交换机不正常工作造成的。发现三层的交换机指示灯闪烁不正常，把对应的房间的交换机和主线逐一断开，看其他房间能否上网。断开3320的主线后发现其他指示灯闪烁正常，确定问题在房间3320，重启交换机后，问题顺利解决。出现这个问题的原因可能是3320的交换机质量不好，出现了故障。</P>','无耗材',1),(6907,'4509','2010-04-23 14:00:48.0000000','蔡泽林,','蔡泽林',2,'不能上网','装网卡驱动，卸载瑞星防火墙','无耗材',1),(6908,'1208','2010-04-23 14:03:58.0000000','蔡泽林,','蔡泽林',2,'启动有问题，偶尔漏电','灰尘太多导致接触不良','无耗材',1),(6909,'7228','2010-04-23 14:57:57.0000000','蔡泽林,','蔡泽林',2,'開不了機','<P>插緊內存條</P>','无耗材',1),(6910,'1115','2010-04-23 20:58:09.0000000','祁有盛,','祁有盛',0,'校园网上不了网','物理地址报错，查询后修改他的物理地址','无耗材',1),(6911,'6321','2010-04-25 19:42:32.0000000','陈智翔,任文涛,','陈智翔',2,'上不了网','<P>错误691</P>\r\n<P>获取ip地址较慢，设一个ip地址。</P>\r\n<P>然后重建一个宽带连接就可以了。</P>','无耗材',1),(6912,'7130','2010-04-25 19:49:49.0000000','陈智翔,任文涛,','陈智翔',2,'不能上网','<P>电脑启动到xp读条时蓝屏。有可能是系统问题，也有可能是硬件问题（笔记本），因为每次开机时都会显示bois时间没有设置，并且进入bois设置时间时会死机。是星期四断过电后出现这种情况。</P>\r\n<P>叫她星期六拿到计协维修处重装系统，若重装还是不行，即是硬件问题。</P>','无耗材',1),(6913,'3622','2010-04-26 18:31:22.0000000','章柳洵,','章柳洵',2,'上不了网','发现是交换机的那个口有问题，给她换了个，幸好她宿舍只有3个人要上网','无耗材',1),(6914,'1422','2010-04-27 15:52:15.0000000','李志光,','李志光',2,'要求安装WIN7','<P>该同学自己安装WIN7后不会激活。。所以要求我们重装。。激活了系统就好了</P>','无耗材',1),(6915,'6415','2010-04-28 07:38:08.0000000','任文涛,郑宇玲,甘霖,','甘霖',2,'网络连接相关服务组件无法启动','<P>网络查询得知，是360升级的问题，到时winsock出现问题，开机按F8进入安全模式，在Dos命令行下输入</P>\r\n<P>netsh winsock reset</P>\r\n<P>再打开360安全卫士中的高级修复修复工具，修复lsp和网络设置。</P>','无耗材',1),(6916,'4203','2010-04-29 22:57:20.0000000','任文涛,','任文涛',2,'多间宿舍网速很慢','重启楼层交换机','无耗材',1),(6917,'6118','2010-04-29 23:00:29.0000000','任文涛,','任文涛',2,'上不了网','拆模块','无耗材',1),(6918,'8428','2010-04-28 12:27:24.0000000','晏超,','晏超',2,'系统文件丢失','重装系统','无耗材',1),(6919,'8214','2010-04-28 12:33:11.0000000','晏超,','晏超',2,'打不开任何网页','IE内核损坏，重装系统','无耗材',1),(6920,'7618','2010-04-29 12:35:48.0000000','晏超,','晏超',2,'无法开机','擦拭内存条','无耗材',1),(6921,'2506','2010-04-29 12:43:46.0000000','晏超,','晏超',2,'电脑没有声音+蓝屏','安装声卡驱动，擦拭内存条','无耗材',1),(6922,'5229','2010-04-29