行','无耗材',1),(7474,'9999','2010-10-14 23:00:50.0000000','袁超锋,','袁超锋',2,'win 7 拨号显示651 ','<P>这个在论坛逛得时候看到一个，网址：<A href=\"http://syue.com/edu/System/Windows/5962.html\">http://syue.com/edu/System/Windows/5962.html</A></P>\r\n<P>需要打开 /windows/system32/logfiles 如果看到 wmi文件夹，在wmi文件夹上点右键，点 获取管理员权限 ,后重启即可修复。</P>\r\n<P>如果右击鼠标没有这一项，则要改注册表，具体做法在文章里有。这个论坛里有很多和系统相关的文章。大家有时间就去逛逛。收获肯定会不小的。</P>','无耗材',1),(7475,'5215','2010-10-14 23:06:20.0000000','袁超锋,','袁超锋',2,'线路不稳定。','这个宿舍的主线的2号线问题比较严重，有两种可能。一种是模块的二号线有问题，还有一种可能就是二号线中间有断痕。当然前者的可能性大，但是出于换模块要花钱考虑，就没有给换。重新打线，可以用了。','无耗材',1),(7476,'4528','2010-10-15 23:03:08.0000000','丁友军,李艳,','丁友军',0,'校园网上不了','<P>经典的校园网IP冲突！经验值得分享给新人学习一下！</P>\r\n<P>首先，检查该同学所在宿舍的线路和电脑网卡是否通，可以用测线仪，或者用ping命令，或者是着用别人的电信的号拨一下号试试；</P>\r\n<P>确认没问题之后，再检查该同学的校园网账号是否正确，首先用geimac命令查看正在使用的网卡的物理地址，然后用该同学同宿舍可以上网的同学的电脑到网络中心网址<A href=\"http://mynet.jnu.edu.cn/zhwl/search.htm\">http://mynet.jnu.edu.cn/zhwl/search.htm</A>查看该同学的账号信息，重点对照物理地址是否和现在正在使用的物理地址一样和账号的状态；</P>\r\n<P>如果确认这些都没问题，则应该考虑到是IP冲突的问题了，win7系统有个不好的地方，如果出现IP冲突，只会提示一次，这个比XP差点。所以就需要我们点计算机，管理，时间查看器，然后系统事件里面找到出错信息，找出最近一次的IP冲突信息，从中读取出和该同学IP冲入电脑的物理地址；</P>\r\n<P>然后修改该同学的IP地址，一般修改最后一位即可，并打开cmd，用“ping 该同学被冲突的IP -t”的命令，再打开另外一个cmd界面，输入命令 “arp 该同学被冲突IP -a”，和命令“arp -d”，并用上下方向键不断变换输入两个命令。（第一个命令是查在局域网中使用该同学IP的物理地址，后者是清楚该缓存不过我觉得其实就“ping 该同学被冲突的IP -t”就够了）</P>\r\n<P>同学另一个同学到楼下的交换机房去拔线，先一层一层地拔，然后一间间地拔，直到ping那个被冲突IPping不同为止。</P>\r\n<P>然后找出对应的房号，去找出正在用这个IP的同学，被很遗憾地通知他们宿舍，说他们已经被断网了，必须写检讨到网络中心后才给他们开网。</P>','无耗材',1),(7477,'4503','2010-10-15 23:24:28.0000000','丁友军,李艳,','丁友军',0,'校园网到晚上就上不了','在杨工这边就已经查出了是和楼下的4305的李飞的IP冲突，直接去找李飞，叫他关了就可以了。','无耗材',1),(7478,'4513','2010-10-15 23:25:37.0000000','丁友军,李艳,','丁友军',2,'上不了网','今天最容易的一间，一条看似很新的网线坏了，换根网线即可','无耗材',1),(7479,'5222','2010-10-16 00:08:19.0000000','袁超锋,','袁超锋',2,'接口问题','去了以后发现他们的水晶头上面又是白灰又是铜绿的，刮了他们的水晶头后症状有所缓解，但我发现问题似乎不在这一出，他的拨号会出现651的错误，于是试了我的解决方法，感觉不是很灵验。但是上网应该不成问题。','无耗材',1),(7480,'5332','2010-10-16 00:11:02.0000000','袁超锋,','袁超锋',1,'上不了电信网','用他的号上的时候能连上，但是打不开网页，qq也上不了ping命令部分能ping的通，。最后验证他的账号在别人 那里完全正常，就叫他重新做系统。','无耗材',1),(7481,'6203','2010-10-16 20:01:59.0000000','晏超,','晏超',2,'上不了网','电信宽带帐号IP冲突..........其实不算是个问题，你们懂得.......','无耗材',1),(7482,'7323','2010-10-16 20:03:06.0000000','晏超,','晏超',2,'上不了网','<P>交换机的主线没有接上......</P>','无耗材',1),(7483,'9121','2010-10-16 20:03:42.0000000','晏超,','晏超',2,'楼层交换机的水晶头','用压线钳压一下就行了.......','无耗材',1),(7484,'3222','2010-10-16 22:04:32.0000000','丁友军,李艳,杨蓉蓉,','丁友军',2,'上不了网','水晶头生锈了，用力刮刮就好','无耗材',1),(7485,'3123','2010-10-16 22:05:26.0000000','丁友军,杨蓉蓉,李艳,','丁友军',0,'校园网上不了','电脑借给别人用，没有重新填IP','无耗材',1),(7486,'1108','2010-10-16 22:06:08.0000000','丁友军,杨蓉蓉,李艳,','丁友军',1,'电信拨号629','打电话到电信查状态，证明账号密码正确，但由机主本人道出此号有点特殊，是在某个人退了之后他再办了，所以考虑到很有可能是他的号还有别的同学在用。所以，叫他用同学的号来拨号可以上，证明其机器和线路都没问题，就是账号的问题，故叫他去和北门电信的人理论去了。','无耗材',1),(7487,'5308','2010-10-17 15:30:54.0000000','陈智翔,','陈智翔',2,'模块问题','模块内陷，拆开装上就好了。','无耗材',1),(7488,'5509','2010-10-17 15:32:30.0000000','陈智翔,','陈智翔',2,'上不了网','账号问题，打10000号问说是账号不存在，只能去营业厅解决。','无耗材',1),(7489,'3226','2010-10-17 15:35:54.0000000','陈智翔,','陈智翔',2,'接交换机和路由','<P>已接好，只要分清端口处几条线对应的端口后，就很容易接。</P>','无耗材',1),(7490,'3405','2010-10-17 16:55:24.0000000','周锦龙,许旭健,','周锦龙',2,'错误：619','说是没有报','无耗材',1),(7491,'3526','2010-10-18 11:05:10.0000000','李志光,','李志光',2,'网卡没有驱动','<P>该名同学不小心删除了驱动程序，装上去就好了</P>','无耗材',1),(7492,'7218','2010-10-18 12:40:51.0000000','祁有盛,王曦,杨蓉蓉,','祁有盛',2,'上不了网','<P>去了已经好了</P>','无耗材',1),(7493,'6232','2010-10-17 12:40:51.0000000','祁有盛,王曦,杨蓉蓉,','祁有盛',2,'上不了网','<P>去了已经好了</P>','无耗材',1),(7494,'7117','2010-10-16 12:40:51.0000000','祁有盛,许旭健,','祁有盛',2,'上不了网','<P>校园网物理地址抄错，更改物理地址</P>','无耗材',1),(7495,'8110','2010-10-16 12:40:51.0000000','祁有盛,许旭健,','祁有盛',2,'上不了网','<P>校园网偶尔会段。可能是学校校园网不稳定吧</P>','无耗材',1),(7496,'7301','2010-10-16 12:40:51.0000000','祁有盛,许旭健,','祁有盛',2,'上不了网','无记录','无耗材',1),(7497,'8104','2010-10-16 12:40:51.0000000','祁有盛,','祁有盛',2,'上不了网','无记录','无耗材',1),(7498,'6127','2010-10-16 12:40:51.0000000','祁有盛,','祁有盛',2,'上不了网','使用路由器','无耗材',1),(7499,'1404','2010-10-16 12:40:51.0000000','祁有盛,','祁有盛',2,'上不了网','可能是安装软件导致冲突','无耗材',1),(7500,'6230',