'2010-11-02 18:19:20.0000000','李志光,郑锐江,','李志光',1,'电信无法拨号','用户名密码错误，致电1w号查询，帐号已欠费','无耗材',1),(7643,'7228','2010-11-02 18:17:20.0000000','郑锐江,李志光,','郑锐江',2,'无法上网','电信用户，拨号错误619，打电信客服电话查询，说账号欠费。叫他们拿身份证去营业厅查询一下。','无耗材',1),(7644,'8222','2010-11-02 18:57:58.0000000','王曦,祁有盛,','王曦',2,'上不了网','该同学台式电脑有2个网卡，后面有2个插槽，其中一个上不了网，她之前插到了上不了网的那个端口，换成另一个端口就能上了','无耗材',1),(7645,'9423','2010-11-02 19:09:45.0000000','杨蓉蓉,周锦龙,','杨蓉蓉',2,'上不了网','<P>由于时间久了，导致水晶头松了，夹了之后可以上网</P>','无耗材',1),(7646,'9603','2010-11-03 22:43:39.0000000','周锦龙,','周锦龙',2,'上不了网','卸载金山网盾后好了','无耗材',1),(7647,'1317','2010-11-04 18:36:19.0000000','杨蓉蓉,祁有盛,','杨蓉蓉',1,'电信网上不了','<P>打了解绑电话，让他们解绑后可以上网</P>','无耗材',1),(7648,'1304','2010-11-04 18:37:26.0000000','杨蓉蓉,祁有盛,','杨蓉蓉',2,'接口问题和本地连接受损','<P>接口松了，拆了模块后修好了；本地连接被恶意软件损坏，用winsock修复后可以上网</P>','无耗材',1),(7649,'1704','2010-11-04 20:48:32.0000000','陈智翔,周锦龙,','陈智翔',2,'网线拔出','楼下交换机接口接触不良，换了一个端口就可以了','无耗材',1),(7650,'5207','2010-11-04 20:49:22.0000000','陈智翔,','陈智翔',2,'上不了网','校园网，mac地址填错，已叫杨工修改。','无耗材',1),(7651,'6511','2010-11-05 17:04:30.0000000','周锦龙,','周锦龙',2,'经常断网','有时候只有一个人断网，有时几个人同时断，可能是交换机接触不良，叫她们下次断网时交换接口试试，或直接接主线试试','无耗材',1),(7652,'3607','2010-11-05 19:28:20.0000000','许旭健,袁超锋,杨蓉蓉,','许旭健',2,'上不了网','打开internet协议4的对话框，发现变成自动获取ip地址和dns了，重新输入校园网的ip地址等，就ok了','无耗材',1),(7653,'9425','2010-11-06 18:39:28.0000000','郑锐江,陈智翔,袁超锋','郑锐江',2,'不能上网，网线1，2号线有问题','<P>用侧线仪，1.2.7号灯不会亮。去楼层交换机那边的端口测试（宿舍里面什么都没接）1，2号灯会亮（很奇怪）。我们判断是两边端口应该有一边1，2号线短接了。拆模块，重新打线，再测，不行。是外面交换机那边问题？剪掉水晶头，打线装上。还是不行啊！（我们估计是线中间出问题了）。哪位有好的解决方法的？？！！</P>\r\n<P>（个人想法：不用1,2号线，就是橙色的那两根，两端同时把其他的线放在1,2号位，例如：将棕色那2根在交换机那边和橙色换过来，到宿舍模块那边还是将棕色和橙色对调。还是交叉布线。不知道行不行）</P>\r\n<P>11月7日更新：问题已解决，方法：如锐江所说用其他线代替。现在用蓝白，蓝两根线与橙白，橙两根对调。楼层交换处水晶头重做，线序为：蓝白，蓝，绿白，棕，棕白，绿，橙白，橙。宿舍里的模块也要重打，原来放橙白和橙两根线的位置放蓝白和蓝。</P>\r\n<P>由于我们现在的网络普遍只使用了网线里的4根铜线，这样的做法可以解决，不过以后更高速的网络普及后，可能八根线都要占用，这样就必须想其他办法解决了。留此卤蛋，以警示后人也。宿舍9425，A端口。（可以设为精华就好了。。。。）</P>','无耗材',1),(7654,'6212','2010-11-06 19:07:31.0000000','许旭健,','许旭健',2,'上不了网','去的时候又说上得了网了','无耗材',1),(7655,'4122','2010-11-06 19:09:07.0000000','许旭健,','许旭健',2,'整间宿舍上不了网','把楼层交换机对应的那间宿舍的网线重新插一下就ok了','无耗材',1),(7656,'9427','2010-11-07 17:58:09.0000000','陈智翔,许旭健,郑锐江,','陈智翔',2,'上不了网','楼层交换机处水晶头接触不好，用压线钳压一下就好了','无耗材',1),(7657,'3117','2010-11-07 18:56:47.0000000','许旭健,李志光,袁超锋,陈智翔,','许旭健',2,'本地连接连不上','用压线钳压一下，网线的水晶头再稍微搞一下，网线的接触就好了','无耗材',1),(7658,'3432','2010-11-07 20:30:01.0000000','杨蓉蓉,李艳,王曦,','杨蓉蓉',0,'校园网IP地址冲突','由于以前用这个IP的人可能还在用，所以她的网老是时断时续，抄了与她冲突的物理地址，明天给她查','无耗材',1),(7659,'7418','2010-11-06 20:40:13.0000000','丁友军,李艳,','丁友军',2,'拨号769','那个傻冒给了50块让小卖部的人给重装了，然后装了瑞星，结果瑞星让她拨不了号，所以帮她卸了瑞星就得了','无耗材',1),(7660,'2502','2010-11-08 16:43:17.0000000','丁友军,李艳,','丁友军',2,'重启后本地连接不见了','网卡给禁用了','无耗材',1),(7661,'7411','2010-11-08 16:48:50.0000000','丁友军,李艳,','丁友军',2,'能拨通号，但上不了网','账号在电脑能拨通，但就是上不了网。用别人的号也能拨通且可以上网，所以不得不怀疑是帐号问题。然后她又忘记了密码，在别人电脑试了好几个密码，都拨不通，所以……只有解释说是帐号问题。对于这个如此敷衍的回答我都深感内疚。求高人指点？','无耗材',1),(7662,'1127','2010-11-08 18:05:34.0000000','李志光,','李志光',2,'720错误','winsock解决','无耗材',1),(7663,'3115','2010-11-08 19:11:25.0000000','郑锐江,','郑锐江',2,'不能上网','他说又可以了','无耗材',1),(7664,'7301','2010-11-08 21:55:00.0000000','丁友军,','丁友军',2,'填ip','无记录','无耗材',1),(7665,'1508','2010-11-09 17:24:43.0000000','王曦,','王曦',2,'123号线断了','把1236对调4578','无耗材',1),(7666,'3622','2010-11-09 18:04:19.0000000','陈智翔,','陈智翔',2,'上不了网','3号灯不亮，因为是在1号端口处，所以直接接到交换机就可以了','无耗材',1),(7667,'9301','2010-11-09 18:05:28.0000000','周锦龙,','周锦龙',2,'路由器上网，一个正常，一个打不开网页','告诉他电信封路由，叫他办一个账号','无耗材',1),(7668,'4521','2010-11-10 19:43:07.0000000','王曦,陈智翔','王曦',2,'接线','接线 ','无耗材',1),(7669,'4519','2010-11-10 19:43:49.0000000','王曦,陈智翔','王曦',2,'上不了网','4626的交换机导致整层上不了网 好了 ','无耗材',1),(7670,'4630','2010-11-10 19:44:47.0000000','王曦,陈智翔','王曦',2,'主线接错','接线 好了 ','无耗材',1),(7671,'4626','2010-11-10 19:45:19.0000000','王曦,陈智翔','王曦',2,'宿舍交换机导致整层上不了','让她们去换台交换机 ','无耗材',1),(7672,'4622','2010-11-10 19:46:04.0000000','王曦,陈智翔','王曦',2,'没人','无记录 ','无耗材',1),(7673,'6215','2010-11-08 22:43:38.0000000','晏超,章柳洵','晏超',2,'上不了网','线没接好，接好后就行了 ','无耗材',1),(7674,'4210','2010-11-10 22:44:40.0000000','晏超,章柳洵,','晏超',2,'上不了网','楼下交换机接到主交换机的线坏了，剪断后重新打个水晶头就行了','无耗材',1),(7675,'7411','2010-11-10 22:46:31.0000000','晏超,','晏超',2,'能拨号，但是上不了网','在浏览器的工具-&gt;Internet选项-&gt;连接 中找到当前拨号的宽带连接，然后点设置，把代理服务器一栏的勾去掉就行了','无耗材',1),(7676,'8322','2010-11-10 22:48:44.0000000','晏超,','晏超',2,'上不了网','<P>去的时候已经好了........</P>\r\n<P>哥的人品好就是没话说</P>','无耗材',1),(7677,'4626','2010-11-11 09:14:46.0000000','陈智翔,李志光,王曦,','陈智翔',2,'上不了网，并且引起其他宿舍也上不了','<P>如果主线接到宿舍交换机处，其他宿舍就不能上网，而直接接电脑就可以上，其他宿舍也正常。所以判断是交换机的问题，已叫同学去换一个新的交换机。 </P>\r\n<P>&nbsp;</P>\r\n<P>PS：其实应该先要做的一个处理步骤是重启一下宿舍的交换机，看看网络是否恢复正常。有可能只是交换机的一时逻辑错误引起，重启一下可能会可以正常运行。</P>','无耗材',1),(7678,'4521','2010-11-11 09:25:22.0000000','陈智翔,王曦,李志光,','陈智翔',2,'上不了网，模块有问题','有问题的模块是主线口下面那个1号端口，不影响使用，只要将那位置的电脑直接接交换机就可以了，故无需换新模块。而上不了网是因为主线没接到主线端口上。 ','无耗材',1),(7679,'4519','2010-11-11 09:28:39.0000000','陈智翔,王曦,李志光,','陈智翔',2,'上不了网','<P>去到的时候就好了，应该是4626引起的问题。</P>','无耗材',1),(7680,'4630','2010-11-11 09:29:32.0000000','陈智翔,王曦,李志光,','陈智翔',2,'上不了网','主线接到一号端口上面去了，换到主线端口就可以了。','无耗材',1),(7681,'4622','2010-11-11 09:30:47.0000000','陈智翔,王曦,李志光,','陈智翔',2,'上不了网','<P>没人在宿舍，应该也4626引起的问题。</P>','无耗材',1),(7682,'8237','2010-11-09 20:34:31.0000000','郑锐江,','郑锐江',2,'没人','无记录','无耗材',1),(7683,'8206','2010-11-09 20:35:09.0000000','郑锐江,','郑锐江',2,'没人','无记录','无耗材',1),(7684,'4509','2010-11-11 15:47:43.0000000','李艳,','李艳',2,'上不了网','无记录','无耗材',1),(7685,'4521','2010-11-11 15:52:13.0000000','李艳,','李艳',2,'交换机接线','有问题的模块是主线口下面那个1号端口，不影响使用，只要将那位置的电脑直接接交换机就可以了，故无需换新模块。而上不了网是因为主线没接到主线端口上。','无耗材',1),(7686,'2513','2010-11-11 19:35:09.0000000','周锦龙,','周锦龙',0,'校园网IP冲突，上不了网','该同学的机器开了很久都运行还是慢的要死，好几次都都卡死了，只能重启，听同学说平时开机都要等十几分钟到半个钟，晕，真有种重装系统的冲动，后来终于能用了，检查没异常情况，就是上不了，到校园网自助服务查看，发现已经过期了。接下来用360帮她把一些启动项和服务关闭，开机速度开了肯多。','无耗材',1),(7687,'1505','2010-11-11 19:48:30.0000000','周锦龙,','周锦龙',2,'上不了网','模块跟网线接触不良，把网线两端调转过来用就可以了','无耗材',1),(7688,'1207','2010-11-11 19:49:49.0000000','周锦龙,','周锦龙',2,'上网断断续续','去的时候没事，叫他再断网的时候打给我','无耗材',1),(7689,'1404','2010-11-11 19:50:55.0000000','周锦龙,','周锦龙',2,'上网断断续续','去的时候没事，叫他再断网的时候打给我','无耗材',1),(7690,'4630','2010-11-11 21:26:00.0000000','陈智翔,袁超锋,祁有盛,周锦龙,','陈智翔',0,'校园网上不了，这一层的也是一样。','<P>一开始以为是4626的问题，所以先到交换机房把4626的网线拔了。</P>\r\n<P>但是上去后，发现仍不能上。在4624，4630两间宿舍看过，发现是222.200.56.0网段的校园网不能上，不过奇怪的是4630中有一台电脑能正常上网，也是这个网段。当时ping网关能ping通，ping学校的内网开始能ping通，到后面也ping不通了。而ping网址，直接显示找不到相应主机。</P>\r\n<P>当时超锋在宿舍用tracert命令（对这个命令不熟悉的话百度一下）查看数据包转发到网关222.200.56.1所要经过的路由（可简单理解为路径），发现数据包会先经过一个222.200.56.20的地址，再转发到网关。他打电话回网络中心问到是4226的一位同学是用这个地址的（刚好今天也保修）。当时阿武也发现了用arp时查的可上网的那台电脑的网关物理地址和不能上网的网关物理地址不相同（虽然网关IP显示一样）。一开始怀疑是中了arp病毒。</P>\r\n<P>但是将56.20的电脑断开后，仍不能上网，此时超锋用tracert查看是经过56.16，也是在4226。我们拔掉了4226所以在交换机的主线后，可以正常上网。此时就怀疑是那间宿舍交换机的问题，将其拆下来给超锋带回去，截至卤蛋时，能正常上网，网关没有被篡改。</P>','无耗材',1),(7691,'8237','2010-11-12 09:48:00.0000000','袁超锋,','袁超锋',2,'上不了网','去的时候可以了，但是她宿舍是很旧的台式机，他说动了网线就可以了，所以怀疑是线松了，。','无耗材',1),(7692,'8428','2010-11-12 09:49:30.0000000','袁超锋,','袁超锋',2,'上不了网','百度提示dns错误，这个在网上没有特别的解决方法，杀毒。','无耗材',1),(7693,'4129','2010-11-12 19:46:02.0000000','许旭健,王曦,','许旭健',2,'整间宿舍上不了网','<P>把楼层交换机的线重新插一遍就ok了</P>\r\n<P>&nbsp;</P>','无耗材',1),(7694,'4129','2010-11-12 19:40:16.0000000','王曦,许旭健,','王曦',0,'校园网全体宿舍都上不了网 本地连接不通','交换机上那些灯不闪 重启了一下 闪得也很不正常 用测线仪测了主线 根本没信号 旭健去一楼打开整栋楼的交换机看接触不良 换了接触良的端口 问题解决','无耗材',1),(7695,'6132','2010-11-12 18:06:27.0000000','祁有盛,','祁有盛',1,'电信网上不了网','9月份办的电信网，昨天断网了。打10000查询，说是该账户已欠费，让拿着办理宽带的账单去电信营业厅核实下','无耗材',1),(7696,'6412','2010-11-12 18:06:27.0000000','祁有盛,','祁有盛',1,'电信网上不了网','<P>电信网上不了网，打10000验证是密码错误，去营业厅修改密码</P>','无耗材',1),(7697,'4226','2010-11-11 18:06:27.0000000','祁有盛,','祁有盛',0,'校园网上不了网','<P>宿舍交换机有问题，宿舍的两个校园网导致6层一层上不了网，后来换了台交换机就可以上了</P>','无耗材',1),(7698,'7315','2010-11-13 11:05:02.0000000','杨蓉蓉,','杨蓉蓉',1,'电信网上不了网','由于账号被停用，所以上不了网，给电信打电话，电信说欠费了，抄了账号和密码给老师','无耗材',1),(7699,'6515','2010-11-13 11:06:57.0000000','杨蓉蓉,祁有盛,','杨蓉蓉',1,'电信网上不了网','打了解绑电话，而且打了电信客服，他们提示是正常，但是她的电脑仍然提示629、691，抄了他的账户和密码，让老师看，后来可以上了','无耗材',1),(7700,'3128','2010-11-13 18:12:15.0000000','周锦龙,许旭健,','周锦龙',1,'电信断网','两个同学的电信账号都登陆不了，电信网上服务系统也登不上去，打电话给杨工查明已经被电信断了，，但账号还没到期，叫他们去电信服务厅处理。','无耗材',1),(7701,'3514','2010-11-14 16:43:38.0000000','许旭健,王曦,','许旭健',2,'换了主板，上不了网','输入原来的物理地址就ok了','无耗材',1),(7702,'8433','2010-11-14 22:22:20.0000000','许旭健,郑锐江','许旭健',2,'上不了网','用测线仪测试网线没问题，查了一下网卡驱动，好像被误删了，重装网卡驱动就好了 ','无耗材',1),(7703,'4609','2010-11-15 12:15:59.0000000','李志光,','李志光',2,'不能上网，楼下交换机线松了','无记录','无耗材',1),(7704,'3407','2010-11-12 22:20:31.0000000','郑锐江,','郑锐江',2,'水晶头松了，接触不良，很容易断网','换了个水晶头 ','无耗材',1),(7705,'4219','2010-11-13 19:22:16.0000000','郑锐江,','郑锐江',2,'3人有3个账号，想将路由器当交换机用','将主线接到Lan口，其他3个网线也接到Lan口。设置路由，取消DHCP。并告诉他们最好换成交换机。','无耗材',1),(7706,'5325','2010-11-15 18:38:07.0000000','祁有盛,','祁有盛',2,'上不了网','校园网物理地址抄错，更改物理地址','无耗材',1),(7707,'7306','2010-11-15 19:30:26.0000000','许旭健,','许旭健',2,'上不了网','没填dns，填好之后就好了','无耗材',1),(7708,'8324','2010-11-15 21:18:28.0000000','郑锐江,袁超锋,','郑锐江',2,'不能上网，拨号不通','用测线仪，3号灯不亮，确定网线没问题后去楼层交换机处换了个端口就可以拨号了，但是还是开不了网页，把DNS设置好，还是不能上。在internet选项—常规—浏览历史记录—删除里，删了所有东西就可以了。','无耗材',1),(7709,'2425','2010-11-15 21:24:32.0000000','郑锐江,许旭健,','郑锐江',0,'刚办的校园网，不能上网','检查IP设置，没问题。检查物理地址，错了，已经叫她登记下，明天去网络中心改','无耗材',1),(7710,'2326','2010-11-16 16:24:11.0000000','李志光,','李志光',1,'上不了网，经查询是电信帐号欠费了','无记录','无耗材',1),(7711,'2526','2010-11-16 17:51:59.0000000','王曦,祁有盛,','王曦',0,'校园网上不了网 那纸条上的ip地址和网关的位置写翻了','重新输入了真正的ip地址和网关 就可以上网了 ','无耗材',1),(7712,'2626','2010-11-16 17:56:00.0000000','王曦,祁有盛,','王曦',0,'校园网上不了网','经查证，她上报的校园网的物理地址不属于她任何一个网卡的物理地址，改成了她上报的物理地址就可以上网了','无耗材',1),(7713,'3223','2010-11-16 18:37:18.0000000','周锦龙,','周锦龙',2,'接口问题','一号位的网线水晶头有点接触不良，用压线钳压一下就好了，另外他们的交换机一号接口有点问题，跟该同学的网线接触不是很好，给他换个接口，吧其他同学的网线接到一号接口也没问题。','无耗材',1),(7714,'3419','2010-11-16 18:40:46.0000000','周锦龙,','周锦龙',2,'本地连接打叉','发现交换机上该同学的网线的水晶头上满是石灰，怪不得接不上，用小刀把石灰挂掉后可以连上，发现打不开网页，也ping不通百度，怀疑是物理地址抄错了，一查果然是错的，他抄了无线的，把本地连接的物理地址改为无线的就好了。','无耗材',1),(7715,'2511','2010-11-16 22:33:02.0000000','郑锐江,陈智翔,杨蓉蓉,','郑锐江',0,'校园网，不能上网','物理地址里面的0被登记成D了，本来想打电话叫杨工改的，打不通就在她电脑改了。','无耗材',1),(7716,'2527','2010-11-16 22:35:24.0000000','郑锐江,陈智翔,杨蓉蓉,','郑锐江',2,'她说昨天宿舍有3个人不能上网','我们去的时候都可以上，用侧线仪测试也都没有问题，估计是当时她们的交换机出问题了。','无耗材',1),(7717,'7101','2010-11-15 22:45:03.0000000','晏超,','晏超',2,'上不了网','修改物理地址','无耗材',1