',1),(7781,'2520','2010-12-03 17:03:17.0000000','杨蓉蓉,祁有盛,','杨蓉蓉',2,'上不了网','主线接错了，接好主线后可以上了，但主线有点松~她们用的是路由器，现在改成直接一个人用电信网上。','无耗材',1),(7782,'7221','2010-12-03 17:22:45.0000000','许旭健,郑锐江,陈智翔,','许旭健',2,'最近几天会突然断网，昨天一天上不了网，一直持续到中午，现在又可以上了','用的是路由器，她们说，昨天一整天上不了网时用主线直接插电脑，拨号，弹出“被远程计算机终止”。今天中午又突然神奇的好了。排除了线的问题后，怀疑是账号的问题，办了一年的号，怎么会这样呢？','无耗材',1),(7783,'1518','2010-12-03 21:17:05.0000000','周锦龙,','周锦龙',2,'651','网卡驱动没装，装好就行了','无耗材',1),(7784,'1225','2010-12-03 21:18:21.0000000','周锦龙,','周锦龙',2,'678','他自己弄好了','无耗材',1),(7793,'8216','2010-12-04 22:51:39.0000000','郑锐江,许旭健,晏超,','许旭健',2,'上不了网','一是线路问题，网线接楼层交换机的接口有点问题，换另一个接口接下去就可以了；二是驱动问题，重装了网卡驱动就上得了了。','无耗材',1),(7794,'3530','2010-12-05 17:53:57.0000000','杨蓉蓉','杨蓉蓉',2,'上不了网','本地连接显示网络电缆被拔出，接口有点松了，插紧后拨号还是不行，最后禁用了一下本地连接再启用就好了~ ','无耗材',1),(7796,'8224','2010-12-05 19:01:46.0000000','许旭健,','许旭健',2,'上不了网','情况和8216的一样，她说本地连接又打叉了，测试网线没问题，把接楼层交换机的网线水晶头压一下，发现氧化黑了，刮一下，就能连得上了&nbsp; ','无耗材',1),(7797,'7303','2010-12-05 19:48:56.0000000','许旭健,','许旭健',2,'本地连接打叉','<P>用测线仪的主机接插电脑的网线，发现1、2、3、6灯中有两个不亮，用副机接插交换机的网线，还是有问题。发现水晶头氧化严重，用钳压一下，刮刮，还是不行，换个水晶头还是不行。看到墙和衣柜的缝隙还容不得一只手伸进去，决定搬床了，没想到刚动一下，放键盘的抽屉就断了下来，东西也掉了，再扯一下桌上的东西又掉了，看来搬床最好要两个人来保持平衡。结果她说桌上和地下的东西太多了，叫我还是不要拉床。接着我再给网线换一个水晶头，还是不行。当我要请多一两个帮手时，发现有点晚了，我袋子里刚好有条网线，就给她先当成地线直接接交换机用，跟她说明天再来一趟。怀疑有可能是墙上模块的问题，明天再搬床看看。 今天又去了一下，叫了锐江和志光师兄来帮忙，认为是模块有问题，短路了，想要搬床，那位女生始终不肯，因为东西太多，桌子也曾被人拉扯过，连螺丝和铁钉都露出来了，怕弄坏了床。最终她宁愿直接从交换机接线，也不肯搬床。</P>','无耗材',1),(7798,'3126','2010-12-05 21:49:52.0000000','周锦龙,','周锦龙',2,'上不了网','整个宿舍都上不了，直接插主线也上不了，怀疑是楼层交换机的问题，到楼下去换了好几个接口都不行，回到宿舍他说好了……','无耗材',1),(7799,'3209','2010-12-05 21:52:15.0000000','周锦龙,','周锦龙',2,'上不了网','去到时好了','无耗材',1),(7800,'4331','2010-12-05 21:52:41.0000000','周锦龙,','周锦龙',2,'上不了网','说是没有报','无耗材',1),(7801,'7624','2010-12-06 19:16:41.0000000','许旭健,郑锐江','许旭健',2,'插电源本地连接就连不上，拔电源就可以上网了','用测线仪测线路，没问题。插电源本地连接就连不上，拔电源就可以上网了。搬她室友的电脑到她那个地方，在这两种情况下可以上网。试了好久，突然在插电源之后，她电脑的本地连接就连上了，但是上不了网。重来一遍，本地连接又连不上，拔掉电源，又连得上。跟锐江讨论后，怀疑是电源线或电脑硬件的问题。跟她说，明天再去一趟。&nbsp;&nbsp;&nbsp;&nbsp; 今天又去了一趟，重装了网卡驱动，发现还是这个问题。纠结了好久，突然杨蓉蓉说把排插的电源线拔了，直接把电脑电源线插在墙上的插座上，发现神奇的好了。然后把排插接墙上的插座，电脑电源线接排插，本地连接就连上了。 怀疑是排插的问题，不能提供稳定电压。 ','无耗材',1),(7802,'1503','2010-12-06 22:09:01.0000000','祁有盛,','祁有盛',2,'上不了网','本地连接被禁用了，启用本地连接','无耗材',1),(7803,'2520','2010-12-07 09:31:10.0000000','李志光,','李志光',2,'只有一个人能上网','<P>线接错了，主线直接接到电脑去了</P>','无耗材',1),(7804,'5418','2010-12-08 08:40:02.0000000','李志光,','李志光',2,'上不了网','线松了，男生居然也会遇上这种问题。','无耗材',1),(7805,'6215','2010-12-07 17:39:53.0000000','王曦,周锦龙,','王曦',2,'上不了网','校园网账号过期 让她续费就可以了','无耗材',1),(7806,'8322','2010-12-08 17:41:06.0000000','王曦,周锦龙,','王曦',2,'她在家重装了系统 “宽带连接”显示“**断开（忘了）” 初步怀疑没装好驱动 但是貌似问题不在这 不知道为啥','重新建立一个“宽带连接” 输入用户名密码 连接成功 可以上网了','无耗材',1),(7807,'1316','2010-12-08 17:58:57.0000000','陈智翔,','陈智翔',2,'ip冲突(怀疑是1203)','<P>去到1203询问，只有一位同学以前用过校园，并且他的ip是自动获取的，所以应该不是他引起。</P>\r\n<P>然后去到1316，没有冲突，那位同学说只是上午时冲突了一会。</P>','无耗材',1),(7808,'4220','2010-12-08 21:57:54.0000000','李志光,','李志光',0,'校园网上不了','<P>过去一看无法有感叹号，系统事件没有任何错误警告，arp缓存只有几个条目。</P>\r\n<P>禁用一下再开居然好了！！</P>\r\n<P>我就纠结了暂时找不到一个较为合理的解释</P>','无耗材',1),(7809,'2605','2010-12-10 12:44:39.0000000','王曦,','王曦',2,'物理地址错误','<P>修改了物理地址</P>','无耗材',1),(7810,'1206','2010-12-06 19:48:06.0000000','祁有盛,','祁有盛',2,'上不了网','<P>主线接错</P>','无耗材',1),(7811,'1305','2010-12-10 19:49:02.0000000','祁有盛,','祁有盛',2,'IP冲突','IP冲突，查到与1427宿舍的一同学IP冲突。找到1427同学，让修改了IP','无耗材',1),(7812,'2520','2010-12-10 23:53:18.0000000','许旭健,王曦','许旭健',2,'路由器wan端口有问题','用她借来的路由器，就可以连上了 ','无耗材',1),(7813,'3630','2010-12-10 23:54:48.0000000','许旭健,','许旭健',0,'把校园网的用户参数填进去后，弹出IP地址被分配到无线网卡','禁用无线网卡，重启，还是不行，重装无线网卡驱动','无耗材',1),(7814,'71XX(单号)','2010-12-11 00:09:57.0000000','杨蓉蓉,章柳洵,晏超,','杨蓉蓉',2,'上不了网','由于7123宿舍的交换机影响整层都上不了网，最后拔了他们的交换机其他宿舍就可以上了，让他们换交换机','无耗材',1),(7815,'7127','2010-12-11 00:12:26.0000000','杨蓉蓉,章柳洵,晏超,','杨蓉蓉',2,'上不了网','仍然是交换机的问题~','无耗材',1),(7816,'5418','2010-12-11 01:15:11.0000000','郑锐江,','郑锐江',2,'上不了网','宿舍其他人可以上网，用测线仪测他那网线。3号灯不亮，用压线钳压一下就好了。 ','无耗材',1),(7817,'2401','2010-12-11 16:17:45.0000000','李艳,','李艳',2,'上不了网','本地连接禁用了，启用本地连接就好了。','无耗材',1),(7818,'7110','2010-12-12 19:18:03.0000000','郑锐江,杨蓉蓉