年经验，在看到实际情况后，条件反射式地操作了一下电脑，然后就可以上网了。','无耗材',1),(7837,'2531','2010-12-06 21:04:35.0000000','甘霖,','甘霖',2,'上不了网','经过本人的多年经验，在看到实际情况后，条件反射式地操作了一下电脑，然后就可以上网了。','无耗材',1),(7838,'8630','2010-12-07 21:05:09.0000000','甘霖,','甘霖',2,'上不了网-6~7点到。','在寒风中等待了近半个小时，吃了个饭回来，准备走的时候，她来了，她把这事给忘了，好冷啊。','无耗材',1),(7839,'5605','2010-12-08 21:06:49.0000000','甘霖,','甘霖',2,'上不了网','经过本人的多年经验，在看到实际情况后，条件反射式地操作了一下电脑，然后就可以上网了。','无耗材',1),(7840,'6430','2010-12-10 21:07:13.0000000','甘霖,','甘霖',2,'上不了网','经过本人的多年经验，在看到实际情况后，条件反射式地操作了一下电脑，然后就可以上网了。','无耗材',1),(7841,'3209','2010-12-17 18:29:13.0000000','郑锐江,','郑锐江',1,'电信用户。不能上网。最近经常会，有时候能上QQ，但是不能上网','3211也一样。。。他们说有时上着上着就不能开网页了，但是QQ还是正常使用。查看了他的DNS以及代理都没有问题。是上着上着突然就不行的，谁知道这是怎么回事。。。。是电信网。。','无耗材',1),(7842,'3231','2010-12-17 18:31:47.0000000','郑锐江,','郑锐江',2,'不能上网','那个宿舍刚买的电脑，办了电信网，都不知道怎么拨号，以为插上网线就可以上网。帮他设置拨号，不过他们没有密码，要等另外一个室友回来，试了下，可以验证用户名和密码。','无耗材',1),(7843,'82XX','2010-12-18 18:40:49.0000000','许旭健,祁有盛,','许旭健',2,'那一层双号房那边最近总是有几间宿舍上不了网','昨天去的时候，连续几间宿舍是出现上得了QQ上不了网，查了一下代理服务器等等，发现跟电脑本身都没关系。重启了三次交换机，还是不行。再把接楼层交换机的线接到可以上网的接口上，就可以上。两个交换机互换主线插，也是不行。初步判断有可能是交换机的问题，今天换了个新交换机，问题解决。下午又有那一层的宿舍报修，查了一下，是中午插线时给弄松了，重新插，就可以了。','无耗材',1),(7845,'7320','2010-12-19 17:47:27.0000000','许旭健,周锦龙,杨蓉蓉,','许旭健',2,'无记录','去的时候说可以了','无耗材',1),(7846,'7619','2010-12-19 17:48:13.0000000','许旭健,周锦龙,杨蓉蓉,','许旭健',2,'整间宿舍上不了网','主线水晶头坏了，换个水晶头','无耗材',1),(7847,'8218','2010-12-20 19:36:00.0000000','许旭健,','许旭健',2,'上不了网','接楼层交换机的线有点松，重新插紧。','无耗材',1),(7848,'6314','2010-12-20 21:47:29.0000000','章柳洵,晏超,','章柳洵',2,'上不了网','去的时候发现她人还在澳门，电脑也不知道在哪里，叫她明天再保修','无耗材',1),(7849,'8218','2010-12-21 17:58:13.0000000','杨蓉蓉,郑锐江,','杨蓉蓉',2,'上不了网','交换机的接口松了，确认插好后可以上网','无耗材',1),(7850,'3402','2010-12-21 20:26:23.0000000','祁有盛,王曦,','祁有盛',2,'上不了网','本地连接显示未识别的网络，宽带连接显示通不过WAN端口，用别人的电脑在他的网线那里试可以上网，他的电脑在别人那里也不可以上网。重新装了网卡驱动，用WINSOCKFIX修复本地连接，还是不可以，最后让他回复下系统，如果还是不能上再保修','无耗材',1),(7851,'8228','2010-12-21 20:26:23.0000000','祁有盛,许旭健,','祁有盛',2,'上不了网','<P>同时保修，8228，8230，8238都是一种情况，可以上QQ,但不开网页，后来发现这些都在一台交换机上，但是这台交换机上有些是可以，有些不可以，将不可以上的与可以上的在交换机那里换一下借口，不可以上的就可以上了（但是反应很慢，得过好几分钟以后才可以），最后确定是交换机的问题，换了个交换机后就都可以了</P>','无耗材',1),(7852,'8204','2010-12-21 21:09:16.0000000','郑锐江,许旭健,杨蓉蓉,','郑锐江',2,'上不了网','和8218一样，把楼层交换机那边的水晶头用压线钳压一下。。','无耗材',1),(7853,'4322','2010-12-22 21:55:09.0000000','李志光,陈智翔,','李志光',2,'被智翔拔网线了','RT，插回去重启交换机','无耗材',1),(7854,'3402','2010-12-22 21:56:01.0000000','李志光,','李志光',2,'无法上网，昨天已经搞过了还不行','651错误，改mac解决了问题','无耗材',1),(7855,'4523','2010-12-24 17:56:56.0000000','许旭健,','许旭健',2,'宽带上不了网','能验证用户名和密码，之后弹出“被远程计算机终止”，打电话问了一下，说账号已过期，叫她明天去问一下','无耗材',1),(7856,'1202','2010-12-24 19:03:47.0000000','李志光,郑锐江,','李志光',2,'恶意占用IP','<P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 首先严重BS该宿舍的人，一进去就开始爆我粗，占用了人家IP还这么理直气壮？</P>\r\n<P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 由锐江得知昨天已经出现了一次了，主要是要进行局域网游戏所以改IP的，锐江已经跟他说过这样是不行的，可以说这次是明知故犯了。目前受害者1603已经能正常上网了。</P>\r\n<P>该宿舍目前已被拔线。。。</P>','无耗材',1),(7857,'8111','2010-12-24 20:51:39.0000000','杨蓉蓉,王曦,','杨蓉蓉',2,'模块问题','模块陷进去了，把模块拆了之后，重新安装就可以了~','无耗材',1),(7858,'4420','2010-12-25 17:03:05.0000000','许旭健,郑锐江,','许旭健',2,'本地连接时好时坏','网线插模块，另一端用测线仪测了一下，没问题。再用副机接接交换机的网线那端，也没问题。他说是模块接触不良，接电脑后，有时碰一下接模块的水晶头，本地连接会连不上。看了一下，模块接口的一排8根铁片，除了从右开始数前3根没问题外，其余的都凹陷下去了。跟甘霖师兄借了镊子，把模块接口处的铁片挑高，插电脑后，能连得上了，也不会随便碰一下水晶头就连不上。','无耗材',1),(7859,'7606','2010-12-27 17:56:03.0000000','李志光,','李志光',0,'校园网上不了','<P>新办的校园网，IP不会填</P>','无耗材',1),(7860,'8238','2010-12-27 17:57:08.0000000','李志光,','李志光',2,'undefined','&nbsp;&nbsp; 没人，明天再去一次','无耗材',1),(7861,'7515','2010-12-28 16:31:28.0000000','李志光,','李志光',0,'新办的校园网有问题','回执中的IP写错了，更正后OK','无耗材',1),(7862,'1318','2010-12-28 16:32:11.0000000','李志光,','李志光',2,'网线接触不良','RT，挂一下就连上了。','无耗材',1),(7863,'7618','2011-01-02 19:49:48.0000000','许旭健,','许旭健',2,'上不了网','<P>电信网用户，用路由器，在本地连接属性的internet协议中DNS填的是校园网的DNS，将其改成自动获取</P>','无耗材',1),(7864,'6632','2011-01-04 19:14:38.0000000','许旭健,','许旭健',2,'上得了QQ 上不了网','把代理服务器的设置弄掉，问题就是这么简单。起初我把设置改了，发现还是打不开网页，搞了好久，后来才知道忘记重启一下电脑了。看来，很多电脑的设置改完之后，重启电脑有时才会生效。','无耗材',1),(7865,'3217','2011-02-26 17:25:35.0000000','郑锐江,陈智翔,','郑锐江',2,'不能上网','用测线仪连接主线，完全没反应，到楼下交换机看，那间宿舍的线被拔出来了，插回去就能上了','无耗材',1),(7866,'3219','2011-02-26 17:28:15.0000000','郑锐江,陈智翔,','郑锐江',2,'不能上网','去的时候他说好了','无耗材',1),(7867,'3103','2011-02-26 17:28:49.0000000','郑锐江,陈智翔,','郑锐江',0,'宿舍有2台电脑，都是校园网，一个能上网，一个不能','ping网关经常丢失，在他们宿舍的交换机那边换个接口就可以了，应该是他那根线接触不良或者他们的交换机的问题','无耗材',1),(7868,'4526','2011-02-26 22:52:51.0000000','郑宇玲,','郑宇玲',2,'上不来网','总交换机线松','无耗材',1),(7869,'2302','2011-02-28 19:59:21.0000000','郑锐江,','郑锐江',2,'3楼整层，不能上网','楼下的交换机主线被拔掉了（查IP冲突时忘记插上），超峰中午连上就好了。','无耗材',1),(7870,'2701','2011-02-28 20:01:55.0000000','郑锐江,甘霖,','郑锐江',2,'不能上网','直接连主线没反应，下楼一看，还是被拔了，考虑到有可能是IP冲突的那间宿舍，不过一问他们宿舍2个校园网，1个从一开始就是电信网，插上。（发现2栋那边的交换机有几个接口是坏的，注意注意）','无耗材',1),(7871,'3102','2011-02-28 20:05:19.0000000','郑锐江,','郑锐江',2,'不能上网，错误629','昨天和有盛去过，那时认为是他们的路由器有问题，就从隔壁借了个过来试试，后来还回去的时候有叫他改回去，今天搞了很久，问了电信，他说账号正常。最后受不了，去隔壁检查，他没改回去。。。。。杯具啊！','无耗材',1),(7872,'7103','2011-02-28 20:12:02.0000000','郑锐江,','郑锐江',0,'校园网不能上网','抄成无线网卡的物理地址了，我把本地连接物理地址改了。','无耗材',1),(7873,'8217','2011-02-28 20:17:01.0000000','许旭健,','许旭健',2,'宽带连接连不上','重新输入账号密码，还是不行，打电话给10000，说密码错误','无耗材',1),(7874,'8228','2011-02-28 20:18:47.0000000','许旭健,','许旭健',2,'网时断时续','断网时，接到室友的模块，可以上。但接她的模块就不行。起初怀疑模块有问题，拆开检查，把8跟接到模块的线再弄紧一点。再开楼层交换机，发现对应的线没插稳，重新插稳。','无耗材',1),(7875,'4231','2011-02-28 21:51:07.0000000','祁有盛,杨蓉蓉,','祁有盛',2,'上不了网','交换机处的主线松了','无耗材',1),(7876,'4415','2011-02-28 21:51:07.0000000','祁有盛,杨蓉蓉,','祁有盛',2,'上不了网','交换机处的主线松了','无耗材',1),(7877,'9210','2011-02-28 21:51:07.0000000','祁有盛,杨蓉蓉,','祁有盛',2,'上不了网','交换机处的主线松了','无耗材',1),(7878,'9511','2011-02-28 21:51:07.0000000','祁有盛,杨蓉蓉,','祁有盛',2,'上不了网','交换机处的主线松了','无耗材',1),(7879,'3524','2011-02-28 22:31:46.0000000','丁友军,李艳,','丁友军',2,'上不了网','网卡的驱动被她自己不知道怎么弄的弄坏了，重装网卡驱动即可','无耗材',1),(7880,'3511','2011-02-28 22:33:41.0000000','丁友军,李艳,','丁友军',2,'上网断断续续','最头疼就是这些了，查看了线路，网卡驱动以及事件管理器里面的日志，没有发现类似与IP冲突的问题。而且上网很正常','无耗材',1),(7881,'3609','2011-02-28 22:39:27.0000000','丁友军,李艳,','丁友军',2,'上不了网','<P>校园网，现在续费后就上不了了。根据施主的描述，断定肯定是当年办校园网的时候就已经把物理地址搞错，所以帮她把物理地址改了果然就行了</P>','无耗材',1),(7882,'3625','2011-02-28 22:41:21.0000000','丁友军,李艳,','丁友军',2,'上不了网','最弱智的一个，没插网线就在那里叫疼……','无耗材',1),(7883,'4122','2011-02-28 22:41:50.0000000','李志光,','李志光',0,'校园网不能上','报错了mac','无耗材',1),(7884,'3706','2011-02-28 22:42:10.0000000','丁友军,李艳,','丁友军',2,'上不了网','首先，主线插错了，导致只有一个人可以上，而且每个人的号都过期了（或者还没补办好），不过最后还是给她们找到一个号来试，问题解决','无耗材',1),(7885,'3705','2011-02-28 22:43:16.0000000','丁友军,李艳,','丁友军',2,'上不了网','中途杀出来的保修。校园网，问题很简单，IE和所有浏览器都打不开网页；问题原因也很简单，她没有天DNS……','无耗材',1),(7886,'2523','2011-02-27 22:44:14.0000000','丁友军,李艳,','丁友军',2,'IP冲突','今天晚上弄到7点，一切的源头都是因为小武哥的一句在04年之后就没有人用过156的那个IP！！！！！！！！然后查IP的时候，用ping一直都是放回request timed out……，这个用arp-a和arp-d可以解决。然后就是2518的线真的藏得太好，在主线的交换机上，导致我们拔了两轮，然后再拔了3轮主线才找出来！结果发现人家就是上个学期办的网，小武哥，你叫我怎么忍心断无知之人的网呢？所以一肚子的气只好憋着，小武哥，改天请喝水~~·····~','无耗材',1),(7887,'7216','2011-02-26 22:48:53.0000000','丁友军,李艳,','丁友军',2,'上不了网','连线','无耗材',1),(7888,'2531','2011-03-01 12:29:06.0000000','章柳洵,','章柳洵',0,'校园网上不了网','发现她校园网过期了。。。叫她去续费，而且改IP等为自动获取。','无耗材',1),(7889,'6127','2011-02-28 18:20:16.0000000','王曦,','王曦',0,'校园网续费后上不了','<P>她当初那张纸条丢了&nbsp;经查询暨南大学网络中心网站 校园网参数 发现是电脑上ip地址等不对 改回来就能上了</P>','无耗材',1),(7890,'3525','2011-03-01 19:19:31.0000000','王曦,杨蓉蓉,','王曦',0,'校园网上不了','ip地址填错了 改了就能上了','无耗材',1),(7891,'3512','2011-03-01 19:20:24.0000000','王曦,杨蓉蓉,','王曦',2,'上不了网','该同学用的是苹果 需要一个usb转接头上网&nbsp;其他线路是好的 用测线仪测出是这个转接设备有问题 让她去换一个','无耗材',1),(7892,'3514','2011-03-01 19:23:06.0000000','王曦,杨蓉蓉,','王曦',0,'校园网上不了','物理地址报错 打电话让修改了 现在应该可以上网了','无耗材',1),(7893,'6127','2011-02-28 19:24:08.0000000','王曦,','王曦',0,'校园网上不了','ip地址填错了 改了就能上了','无耗材',1),(7894,'8436','2011-03-01 19:21:32.0000000','许旭健,','许旭健',2,'上不了网','物理地址抄错，把它改成她抄到网络中心的那个','无耗材',1),(7895,'8438','2011-03-01 19:25:32.0000000','许旭健,','许旭健',2,'上不了网','用测线仪测下模块，3号灯不亮；把接楼层交换机的线的水晶头压一下，刮一刮，可以上了&nbsp;&nbsp;&nbsp; 小弟最近老是碰到楼层交换机问题，大多数是因为线插不稳，或水晶头生锈','无耗材',1),(7896,'8501','2011-03-01 19:27:49.0000000','许旭健,','许旭健',2,'宽带连接提示629','<P>能验证用户名和密码，起初以为是密码不对，打10000，密码没问题；但是，接她室友那边的线能连上。于是怀疑模块或接楼层交换机那边的线的问题，用压线钳压一压，刮一刮，换另一个接口插，可以连上。（感觉很奇怪，一开始明明测了线，显示正常，但偏偏点宽带连接点了几下还是不行的；然后她接到室友的线，又可以了。</P>\r\n<P>上学期，跟有盛碰到过一个也是很奇怪的问题，8栋2层双号那边，连续几间宿舍的宽带连接都可以连上，就是偏偏打不开网页，而QQ登陆却要两分多钟；一开始，还以为是代理服务器设置问题；结果一连问好几间宿舍都是这样，所以跟有盛检查了楼层交换机，采用了主线替换法、控制变量法等办法查了好久，最终确定是楼层交换机的问题。）</P>','无耗材',1),(7897,'8417','2011-03-01 19:32:35.0000000','许旭健,','许旭健',1,'电信网上不了网','<P>她刚装完系统，查了线路等等，发现没问题，就是网卡驱动有点奇怪。重装网卡驱动，还是不行。感觉她这刚装的系统有问题，建议其再重装一次。重装之后，就好了。</P>','无耗材',1),(7898,'7428','2011-03-01 22:03:50.0000000','丁友军,李艳,袁超锋,陈智翔,晏超,','丁友军',2,'拨号651','<P>个人觉得很神奇的一个解决方案：修改网卡的物理地址！</P>\r\n<P>检查了线路，帐号，都没有问题。但是就是拨号拨不通，651错误。最后由宴超大神说试一下修改网卡的物理地址就行了。</P>\r\n<P>总的来说651错误一般来说都是交换机或者路由器的问题，又或者是网卡的驱动没有装好，但是在试过以上几种都不行的话，可以试一下修改网卡的物理地址和修改网卡的工作模式，就是全双工，半双工那个。</P>','无耗材',1),(7899,'7304','2011-03-01 22:15:23.0000000','丁友军,李艳,','丁友军',2,'上不了网','物理地址抄错了','无耗材',1),(7900,'4332','2011-03-01 22:41:44.0000000','郑锐江,','郑锐江',2,'不能上网','<P>楼下交换机处松动了，重新拔插一下就好了</P>','无耗材',1),(7901,'1407','2011-03-01 23:04:26.0000000','祁有盛,周锦龙,','祁有盛',0,'校园网上不了网','<DIV class=gb_msg_class>物理地址报错了</DIV>','无耗材',1),(7902,'6315','2011-03-02 18:05:44.0000000','陈智翔,丁友军,','陈智翔',2,'模块问题，换模块','发现模块没有问题，拨号提示629错误，打10000号查询，是账号欠费问题。已叫那位同学拿到北门电信营业厅处质询。','无耗材',1),(7903,'2120','2011-03-02 18:27:32.0000000','章柳洵,','章柳洵',0,'校园网上不了','最后发现是过期了，刚过期一天。','无耗材',1),(7904,'2124','2011-03-02 18:28:00.0000000','章柳洵,','章柳洵',0,'校园网上不了','IP输入错误','无耗材',1),(7905,'4426','2011-03-02 19:05:05.0000000','李志光,','李志光',0,'校园网到期，让其撤销IP','校园网到期，让其撤销IP，搞掂','无耗材',1),(7906,'2423','2011-03-02 19:05:31.0000000','李志光,','李志光',0,'校园网不能上','RT，设置错了，更正即可','无耗材',1),(7907,'2408','2011-03-02 19:06:01.0000000','李志光,','李志光',0,'校园网不能上','RT，物理线路正常，数据传输正常，无法通过校园网验证，需核实资料。','无耗材',1),(7908,'2419','2011-03-02 19:07:03.0000000','李志光,','李志光',0,'校园网不能上','RT，物理线路正常，数据传输正常，无法通过校园网验证，需核实资料。','无耗材',1),(7909,'1124','2011-03-02 19:18:46.0000000','郑锐江,','郑锐江',1,'电信网，不能上网，错误629','他们是刚办的账号，打10000问，查不到账号，应该是还没有办理成功。叫他再等一两天看看','无耗材',1),(7910,'1426','2011-03-02 19:53:41.0000000','郑锐江,','郑锐江',2,'不能上网','他说好了','无耗材',1),(7911,'1501','2011-03-02 19:54:10.0000000','郑锐江,','郑锐江',0,'校园网，不能上网','他IP设置错了','无耗材',1),(7912,'7203','2011-03-02 19:54:45.0000000','郑锐江,','郑锐江',2,'ip冲突','去的时候可以上了，我跟他说下次冲突打电话给我或网络中心','无耗材',1),(7913,'9511','2011-03-02 19:58:14.0000000','郑锐江,','郑锐江',1,'电信，错误629','换他室友的号就拨号成功，他的号去他室友那边也是629.打10000过去，账号正常，我问他有没有在其他用过他的账号，他说有，我估计是别人在上，叫他问问，如果不行明天就去改密码，还不行就再保修 ','无耗材',1),(7914,'8136','2011-03-02 21:13:16.0000000','许旭健,','许旭健',0,'校园网上不了','物理地址错误，改物理地址','无耗材',1),(7915,'4614','2011-03-02 21:14:11.0000000','许旭健,','许旭健',0,'校园网上不了','<P>我只能说连续两天上不了的网络现在又可以上了</P>','无耗材',1),(7916,'3521','2011-03-03 11:39:52.0000000','王曦,杨蓉蓉,','王曦',0,'校园网上不了','物理地址又上不了 改了就能上了','无耗材',1),(7917,'5602','2011-03-03 11:41:01.0000000','王曦,杨蓉蓉,','王曦',2,'上不了网','我们去的时候可以上网了','无耗材',1),(7918,'3630','2011-03-03 11:41:31.0000000','王曦,杨蓉蓉,','王曦',2,'宿舍2个人上不了网网 还有一个人有段时间突然上不了','一个宿舍多人上不了网的话一开始以为是交换机什么的问题 检查了半天发现不是&nbsp;后来发现原来是那两个同学自身问题 一个是物理地址写错了 一个是ip填错了','无耗材',1),(7919,'8402','2011-03-03 18:37:55.0000000','许旭健,','许旭健',2,'无记录','<P>RP，去的时候说好了</P>','无耗材',1),(7920,'8406','2011-03-03 18:38:35.0000000','许旭健,','许旭健',2,'无记录','<P>RP，去的时候说好了</P>','无耗材',1),(7921,'3232','2011-03-03 20:59:14.0000000','祁有盛,甘霖,袁超锋,','祁有盛',0,'校园网上不了网','<P>校园网上不了网，刚开始去显示本地连接不连通，先去别的宿舍，后来又回来本地连接连通了，但是上网打开网页非常慢，ping掉包率也非常的高，测网线1236都是亮的，没有什么一场，用别的电脑来他那里试也是没有问题的，后来卸载重新安装了下网卡驱动，还是有点慢，但是明显好多了，估计是系统有问题吧，建议再出现问题，恢复下系统试试</P>','无耗材',1),(7922,'3415','2011-03-03 20:59:14.0000000','祁有盛,甘霖,袁超锋,','祁有盛',0,'校园网上不了网','<P>物理地址报错了，帮忙修改了物理地址</P>','无耗材',1),(7923,'1406','2011-03-03 21:28:43.0000000','郑锐江,','郑锐江',0,'校园网不能上网','<P>上网查询，物理地址抄错了一位，把B抄成8了，改之就可以上了</P>','无耗材',1),(7924,'1404','2011-03-03 21:30:02.0000000','郑锐江,甘霖,周锦龙,','郑锐江',2,'不能上网','用测线仪，1号和3号灯不亮，先用压线钳压一下主线那边的水晶头，1号灯就正常亮了，随后观察到这个同学的模块里面与3号灯对应的铜线断了，甘霖师兄刚好有个旧的模块，换上去就好了','无耗材',1),(7925,'1210','2011-03-03 22:15:16.0000000','周锦龙,','周锦龙',2,'上不了网','水晶头和交换机的接触不良','无耗材',1),(7926,'4126','2011-03-03 22:23:14.0000000','周锦龙,','周锦龙',2,'无记录','校园网到期，去掉IP','无耗材',1),(7927,'4112','2011-03-03 22:23:58.0000000','周锦龙,','周锦龙',2,'ip冲突','可能与4426的冲突，去4426的时候没人，叫志光晚上去','无耗材',1),(7928,'1703','2011-03-03 22:25:19.0000000','周锦龙,','周锦龙',2,'早上上不了网','有两天早上8点多的时候上不了，叫他有事再打网络中心','无耗材',1),(7929,'1124','2011-03-03 22:26:23.000