,'无耗材',1),(7949,'7129','2011-03-05 10:45:06.0000000','郑锐江,晏超,丁友军,李艳,','郑锐江',2,'不能上网（早上这宿舍造成整层不能上网）','帮她们接上网线，等一会又整层不能上网了，断开她们宿舍的交换机，主线接电脑上又恢复正常了，去隔壁借了一台交换机用上没问题，所以判断是他们的交换机有问题，叫她买一个换上。','无耗材',1),(7950,'3222','2011-03-05 16:23:35.0000000','陈智翔,袁超锋,','陈智翔',2,'接口有问题','<P>测线，发现三号灯不亮。查看模块接口处，铜片无缺损。试着清理连接交换机处的水晶头上铜片的铜锈，仍是不行。然后拆开模块，重压3号线，仍是不行，也试过将主线下面的模块换过来，仍是3号线不亮，所以怀疑是网线的问题。重打水晶头，排线序时将正规B口3，4号线与5，6号线交换，然后模块处也是这样排序。接好后能正常连上网。</P>','无耗材',1),(7951,'1202','2011-03-05 21:12:27.0000000','祁有盛,郑锐江,','祁有盛',2,'宿舍上不了网','去的时候是整个宿舍上不了网，但是把主线直接接电脑上可以上，怀疑是交换机有问题，重启了下交换机就可以了','无耗材',1),(7952,'4519','2011-03-06 11:51:04.0000000','许旭健,周锦龙,','许旭健',2,'整间宿舍上不了网','测线，发现1、3灯不亮；线路问题；有可能是模块问题、楼层交换机接口、或者是那里接入接口的水晶头问题，而我们首选解决方案是先到楼层交换机那里看看，结果证实是那里的问题。类似的问题之前我在8栋经常碰到。 ','无耗材',1),(7953,'4622','2011-03-06 11:56:13.0000000','许旭健,周锦龙,','许旭健',2,'物理地址抄错','改物理地址；可能是第一次去的同学没看清楚，网络中心网站显示的物理地址跟她电脑的物理地址只是一个字的差别','无耗材',1),(7954,'6118','2011-03-06 17:19:44.0000000','杨蓉蓉,','杨蓉蓉',2,'上不了网','电信网账户被别人使用，所以上不了，对方断开后可以上','无耗材',1),(7955,'7214','2011-03-06 23:00:43.0000000','许旭健,','许旭健',2,'宿舍网线的对联','建议其拉天线或地线','无耗材',1),(7956,'9522','2011-03-07 16:31:08.0000000','周锦龙,','周锦龙',2,'上不了网','<P>3号线不通，楼层交换机那里换一个端口就行了</P>','无耗材',1),(7957,'9504','2011-03-07 16:32:31.0000000','周锦龙,','周锦龙',2,'上不了网','在楼层交换机一端的水晶头没有压紧，压紧就好了','无耗材',1),(7958,'4510','2011-03-07 17:59:43.0000000','杨蓉蓉,许旭健,','杨蓉蓉',2,'上不了网','<P>用路由器，端口不够，虽然办了校园网，但只能用无线上，建议再买交换机</P>','无耗材',1),(7959,'4518','2011-03-07 18:02:59.0000000','杨蓉蓉,许旭健,','杨蓉蓉',2,'上不了网','<P>没有创建宽带连接，所以不能上，新建后可以上</P>','无耗材',1),(7960,'4516','2011-03-07 18:03:56.0000000','杨蓉蓉,许旭健,','杨蓉蓉',2,'全宿舍上不了网','<P>主线接口太松了，一碰就会掉，换了条网线就可以了</P>','无耗材',1),(7961,'4522','2011-03-07 19:51:02.0000000','许旭健,杨蓉蓉,','许旭健',2,'无记录','<P>RP,没人在</P>','无耗材',1),(7962,'1430','2011-03-08 17:47:35.0000000','周锦龙,','周锦龙',2,'上不了网','物理地址错了，修改','无耗材',1),(7963,'6218','2011-03-08 18:36:33.0000000','许旭健,','许旭健',2,'本地连接禁用了','启用','无耗材',1),(7964,'8501','2011-03-08 18:37:58.0000000','许旭健,','许旭健',2,'账号欠费','熟客来着；上学期去过一次，是密码填错；上星期去过一次，线路问题；这次又去一次，打10000号问，说账号欠费了','无耗材',1),(7965,'2702','2011-03-08 19:43:27.0000000','郑锐江,祁有盛,','郑锐江',2,'IP冲突','<P>在网络中心查询到可能是2224过期忘记改掉，去看果然没改，改之！</P>','无耗材',1),(7966,'2509','2011-03-08 19:44:45.0000000','郑锐江,祁有盛,','郑锐江',2,'IP冲突','去的时候不冲突，没办法，留电话走人。','无耗材',1),(7967,'2623','2011-03-08 19:45:30.0000000','郑锐江,祁有盛,','郑锐江',2,'IP冲突','问那个师姐，她说IP借过一个师妹，打电话过去叫她改掉。','无耗材',1),(7968,'3405','2011-03-07 21:57:59.0000000','王曦,','王曦',2,'整间宿舍上不了网','去的时候他们说好了 都可以上网了','无耗材',1),(7969,'3628','2011-03-09 13:28:11.0000000','章柳洵,晏超,','章柳洵',0,'校园网上不了','接口接触不良','无耗材',1),(7970,'2609','2011-03-09 18:28:53.0000000','王曦,','王曦',0,'校园网上不了','她续费以后换了台电脑 帮她查了后把现在的改成了原电脑物理地址 校园网可以上了；但是她同时又想上电信网 但校园网能上了后电信拨号说用户名密码有问题 但是前一秒她还在上电信啊。。。最后又拨了几次 突然又好了。。。后来校园网和电信都可以上了','无耗材',1),(7971,'9237','2011-03-09 20:25:33.0000000','祁有盛,周锦龙,许旭健,','祁有盛',2,'上不了网','<P>显示本地连接没有插好，测网线是只有7号灯不亮。但是电脑上显示本地连接没有连通。怀疑是交换机那边端口有问题，去那边换了个端口，还是不可以。后来测交换机那边和宿舍之间的网线，发现只有主测线仪灯亮，负的不亮，发现把负测线仪拔了，主测线仪也会亮。怀疑是线标宿舍号标错了，所以测线仪在宿舍测，在交换机这边拔线，看拔到哪个线，测线仪灯会灭。后来发现标号标错了，35A对应的是37B。经过这么拔拔插插，9237那间宿舍也可以上网了。（中间还有个悲剧的，拔线的时候不知怎么把交换机的主线给弄掉了，但是把主线又查到交换机上单独的那个主线插孔，这个交换机上的所有人都上不了网了，后来把主线插到普通的插孔上才又可以了）</P>','无耗材',1),(7972,'7401','2011-03-09 20:53:36.0000000','许旭健,','许旭健',2,'无记录','rp，没人在','无耗材',1),(7973,'7603','2011-03-09 20:53:58.0000000','许旭健,','许旭健',2,'无记录','rp，没人在','无耗材',1),(7974,'6417','2011-03-10 18:49:27.0000000','王曦,','王曦',2,'都上不了网','测了一下 主线1号灯不亮&nbsp;插上电脑一直显示正在获取某某某 但是用测线仪连主线和交换机那头灯全是亮的 用针刮了刮接交换机那头的线 还是不行 只要一接交换机 一号线就不亮。。。后来超锋师兄让我自己写个ip啥的 写好了就能上了！耶！','无耗材',1),(7975,'6125','2011-03-10 18:54:22.0000000','王曦,','王曦',0,'两个人校园网上不了','应该是她们校园网都到期了 让她们明天去续费应该就好了','无耗材',1),(7976,'3404','2011-03-10 19:34:59.0000000','郑锐江,许旭健,','郑锐江',2,'上不了网','过去他说好了，下午12点多的时候不能上的，应该和3632那宿舍接再同一台交换机上。','无耗材',1),(7977,'1228','2011-03-10 19:36:10.0000000','郑锐江,许旭健,周锦龙,','郑锐江',2,'上不了网','这宿舍我昨天到今天已经去了3次了，都是弄好后不久又不行了，第一次在他们宿舍用侧线仪侧主线，发现1号灯不亮，网线和模块都没问题，就把副测线仪接主线，主侧线仪拿到下面交换机房连接，全部灯都亮，接着测他们接的那个端口，发现1号不亮，就换到了一个空的端口上（有测过，全亮）就可以上了，到了晚上8点都我就接到他们打来的电话，说又不能上了，我下去看果然不能上（直接接主线），再去网络室看，他们对应的端口的灯又不会闪了，再换了个端口（只有2个空端口，全换过了）又能上了，今天早上又不能上了，下午去的时侯，侧线是正常的，但是不能联网，正准备一人下去拔线，一人留在上面观察时，又可以上了。。纠结。。。断断续续的断网，解释清楚，留下电话，继续关注。','无耗材',1),(7978,'2519','2011-03-10 20:30:19.0000000','杨蓉蓉,','杨蓉蓉',2,'上不了网','<P>校园网，电脑重装了系统，改了一下物理地址</P>','无耗材',1),(7979,'2520','2011-03-10 20:34:04.0000000','杨蓉蓉,','杨蓉蓉',2,'上不了网','她们宿舍用的是两个路由器，因为接错线而且其中一个插口坏了，所以上不了网，接好后就可以上了','无耗材',1),(7980,'5325','2011-03-10 21:13:43.0000000','周锦龙,','周锦龙',2,'桌面向左偏移，左边消失的部分在右边出现','显卡驱动出现问题，叫他更新驱动 ','无耗材',1),(7981,'5330','2011-03-10 21:20:59.0000000','周锦龙,','周锦龙',2,'上不了网','他的网线有问题，更换一条就好了','无耗材',1),(7982,'7114','2011-03-11 18:00:45.0000000','许旭健,杨蓉蓉','许旭健',2,'无记录','哥最近的RP真的是太好了！连续去了几间7栋的宿舍，都没人在！ 哥最近上的几个班，每个班都是没人在宿舍。特别是7栋，前天去了两间，都是没人在；今天又去了两间，又都是没人在！在下真的很佩服哥的RP！ ','无耗材',1),(7983,'7303','2011-03-11 18:01:59.0000000','许旭健,杨蓉蓉','许旭健',2,'无记录','哥最近的RP真的是太好了！连续去了几间7栋的宿舍，都没人在！ 哥最近上的几个班，每个班都是没人在宿舍。特别是7栋，前天去了两间，都是没人在；今天又去了两间，又都是没人在！在下真的很佩服哥的RP！ ','无耗材',1),(7984,'8412','2011-03-11 20:33:43.0000000','丁友军,李艳,','丁友军',2,'上不了网','重启楼层交换机','无耗材',1),(7985,'8418','2011-03-11 20:34:14.0000000','丁友军,李艳,','丁友军',2,'上不了网','重启楼层交换机','无耗材',1),(7986,'8420','2011-03-11 20:34:32.0000000','丁友军,李艳,','丁友军',2,'上不了网','重启楼层交换机','无耗材',1),(7987,'4518','2011-03-12 17:57:28.0000000','许旭健,郑锐江','许旭健',2,'上不了网','主线没插好，交换机的电源没接好 ','无耗材',1),(7988,'4316','2011-03-14 18:26:22.0000000','李志光,','李志光',2,'无法上网','<P>前几天断过一次网，一阵子之后就正常了，现在能正常使用。应该是我们维护的时候操作造成的。</P>','无耗材',1),(7989,'4518','2011-03-14 19:11:14.0000000','许旭健,','许旭健',2,'上得了QQ，打不开网页','<P>代理服务器问题；她的两个浏览器都打不开网页，一个是Ie，按常规设置，把代理服务器去掉，ie能上；另一个是紫狐，非ie内核的，在“工具-选项-高级-网络-设置”，第一次把代理服务器改成“无代理”，不行；第二次改成“自动寻找代理服务器”就可以了。</P>\r\n<P>紫狐浏览器，专门供IPv6上网使用。紫狐浏览器是清华大学互联网服务与系统研究中心与Mozilla中国合作研发的一款基于Firefox内核的面向清华校内的浏览器。主要特色就是通过IPv6隧道技术能访问ipv6, facebook和一系列google服务。</P>','无耗材',1),(7990,'8119','2011-03-14 20:01:25.0000000','许旭健,','许旭健',2,'宽带691或619','线路没问题；打10000，账号密码没问题；看设备管理器，驱动没问题；重拨好几次，老是691或619；重建宽带连接，还是不行；她说之前有借过别人，但已经叫她朋友断了；她室友电脑不在，问她能不能找另外一部电脑试试，死活不肯，说隔壁好几间宿舍都不认识人；结果，俺下定决心，厚着脸皮红着脸鼓起勇气到2楼找一位熟客（其实也不是很熟）借电脑，试8119同学的账号，还是不行；于是判定是账号问题，估计还是有人用她的账号，建议她去电信改另一个密码。 ','无耗材',1),(7991,'8234','2011-03-15 16:54:29.0000000','丁友军,李艳,','丁友军',2,'上不了网','<P>接线接错</P>\r\n<P>&nbsp;</P>','无耗材',1),(7992,'7202','2011-03-15 16:55:26.0000000','丁友军,李艳,','丁友军',2,'上不了网','<P>填错物理地址</P>','无耗材',1),(7993,'3506','2011-03-15 16:56:15.0000000','丁友军,李艳,','丁友军',2,'上不了网','说每天早上第一次联网都连不上去，都需要打电话到电信那边，电信那边帮她弄一下才行，我看了一下，应该是一位她电脑上面有一个USB的连接，而且每次弹出窗口都是显示这个连接，所以把她的这个给禁用了，希望下次不要乌龙了','无耗材',1),(7994,'3708','2011-03-15 16:59:33.0000000','丁友军,李艳,','丁友军',2,'整个宿舍上不了网','交换机的问题','无耗材',1),(7995,'3703','2011-03-15 17:00:35.0000000','丁友军,李艳,','丁友军',2,'上不了网','楼层交换机的问题','无耗材',1),(7996,'3703','2011-03-15 17:00:58.0000000','丁友军,李艳,','丁友军',2,'上不了网','楼层交换机的问题','无耗材',1),(7997,'3626','2011-03-15 17:01:26.0000000','丁友军,李艳,','丁友军',2,'上不了网','3632的交换机的影响','无耗材',1),(7998,'3632','2011-03-15 17:01:54.0000000','丁友军,李艳,','丁友军',2,'上不了网','<P>其交换机很有问题，已交代他们要经常重启交换机</P>','无耗材',1),(7999,'8406','2011-03-15 17:02:54.0000000','丁友军,李艳,','丁友军',2,'有时候会突然断网','这个……（此处省略一万字）','无耗材',1),(8000,'2619','2011-03-15 17:03:36.0000000','丁友军,李艳,','丁友军',2,'上不了网','<P>第二次被摆乌龙，人家没有IP冲突又断了人家的网，下次一定要确定再弄啊</P>','无耗材',1),(8001,'3109','2011-03-15 17:06:14.0000000','丁友军,李艳,','丁友军',2,'接口有问题','是借口有问题，不过是他们的交换机的接口……','无耗材',1),(8002,'4316','2011-03-15 17:06:50.0000000','丁友军,李艳,','丁友军',2,'上网断断续续','这个，那个，不解释……','无耗材',1),(8003,'6320','2011-03-15 18:18:10.0000000','许旭健,','许旭健',2,'宽带629','打10000，说是欠费停机','无耗材',1),(8004,'7411','2011-03-15 18:59:05.0000000','周锦龙,','周锦龙',2,'上不了网','抄错物理地址了','无耗材',1),(8005,'5502','2011-03-15 19:52:25.0000000','祁有盛,','祁有盛',2,'上不了网','打不开网页，用翻墙软件上非死不可，导致不能打开网页了，取消代理后就可以打开网页了。告诉他，大陆非死不可已经被和谐了','无耗材',1),(8006,'2109','2011-03-16 16:23:37.0000000','丁友军,李艳,','丁友军',2,'上不了网页','浏览器的设置问题，重置后解决','无耗材',1),(8007,'2519','2011-03-16 19:54:51.0000000','许旭健,','许旭健',2,'物理地址抄错','<P>改之（是把D抄成B了，之前我也碰到过几间宿舍也是这样；俺觉得有可能是我们网络中心抄错她给的物理地址了；一般的同学大多数是把有线网卡的物理地址抄成无线网卡的）&nbsp; 还有另一个问题，就是机子不能发出声音，看一下驱动没问题；后来在控制面板，把之前的音频设备改成另一个，就可以了。像机子不能发出声音，鼠标动不了等等，有时是电脑设置的问题，只要在控制面板改好了，一般是没问题的。</P>','无耗材',1),(8008,'6109','2011-03-16 22:52:53.0000000','郑锐江,祁有盛,','郑锐江',2,'不能上网','他说好了','无耗材',1),(8009,'6624','2011-03-18 21:56:34.0000000','许旭健,','许旭健',2,'她说经常看视频或听音乐之后过了半个钟或一两个小时就上不了网','查看线路，本地连接，驱动都没问题。我去的时候，看不到她所说的问题；纠结，给个电话，叫她下次出问题立刻打电话给我。','无耗材',1),(8010,'4632','2011-03-18 23:19:20.0000000','甘霖,丁友军,李艳,袁超锋,许旭健,','甘霖',2,'四栋五楼六楼大面积无法上网','&nbsp;&nbsp;&nbsp;&nbsp; 先检查楼层交换机，发现交换机没问题，线路测试也正常，经过检查，是4507宿舍的交换机有点问题，而且其中一人的电脑可能因下载软件导致电脑中毒，无法上网，最后重装系统，解决问题！','无耗材',1),(8011,'4103','2011-03-19 17:06:27.0000000','周锦龙,','周锦龙',2,'可以上q，打开不网页','ping <A href=\"http://www.baidu.com\">www.baidu.com</A> 不通，怀疑是dns没填，查看果然没填，填上就好了','无耗材',1),(8012,'4608','2011-03-20 16:32:55.0000000','郑锐江,杨蓉蓉,','郑锐江',2,'整宿舍不能上网','过去就想找主线测一下，发现他们没接主线。她说早上打电话去网络中心，那边叫他直接接主线看看能不能上，他就把主线接到电脑上去了（其实她应该搞错了，把主线连到宿舍交换机那边拔掉，然后换上他电脑的网线，相当于没接主线。。呵呵。。）','无耗材',1),(8013,'3703','2011-03-20 16:53:22.0000000','周锦龙,郑宇玲,','周锦龙',2,'整个宿舍上不了网','用主线可以上，接交换机上就上不了，断开交换机电源，换根主线，再接回交换机就可以了','无耗材',1),(8014,'1605','2011-03-20 20:02:52.0000000','许旭健,','许旭健',2,'IP冲突','校园网信息都正确；重启电脑，弹出IP冲突；在事件查看器也看到IP冲突的日志；把阿福室友的IP改成阿福的（都是同个IP段的），ping他室友的IP，ping不通（ping得通可以节省更多时间）；换另一种方法，把他室友的IP改成他原来的，此时肯定是ping不通的，ping命令的窗口先别关，我在下面拔线，叫阿福不断的禁用和启用本地连接，拔到1117，启用时ping得通（Reply from……），本地连接也连上。 ','无耗材',1),(8015,'7104','2011-03-21 18:40:04.0000000','许旭健,郑锐江','许旭健',2,'上网断断续续','她说有时是刚连上过一会就断网，有时是连上之后过一个小时就断网。问她断网时能不能验证用户名和密码，说不能，怀疑是线路问题。果然我刚一碰她的网线，交换机对应的灯就灭了。稍微再动一下，有连得上，交换机对应的灯又闪了。观察其网线，是那种便携式网线，很薄的那种，一看就知道质量是不行的。最后，把我的网线给了她，走人。 ','无耗材',1),(8016,'5612','2011-03-21 18:45:05.0000000','许旭健,','许旭健',2,'上不了网','不能验证用户名和密码，线路问题。把接电脑的线接在测线仪主机，把接交换机的线接在副机，6号灯不亮。把接模块的那头拔出来，测线，没问题，再插回模块去，1、2、3、6都亮。再把线插回电脑和交换机，还是不可以上。再把接电脑的那头接测线仪，发现6号灯不亮。怀疑是对应交换机端口的问题，换另一个端口插，6又亮了，宽带又能连上。','无耗材',1),(8017,'8213','2011-03-21 20:09:44.0000000','郑锐江,','郑锐江',1,'电信，无法上网','错误691，重新输入账号密码，ok','无耗材',1),(8018,'3201','2011-03-22 17:51:03.0000000','周锦龙,蔡曼仪,','周锦龙',2,'经常断网','他们说一天断一两次，时间为3到5分钟，而且和3203的一起断，初步不知道是什么问题，先把3201的线接到别的楼层交换机上去，3203的保持不变，看看什么情况','无耗材',1),(8019,'6511','2011-03-22 18:54:05.0000000','许旭健,','许旭健',2,'上不了网 上得了QQ','代理服务器问题，改之','无耗材',1),(8020,'7401','2011-03-22 18:55:21.0000000','许旭健,','许旭健',2,'物理地址抄成别的','改之','无耗材',1),(8021,'8525','2011-03-23 17:51:10.0000000','许旭健,黄永福,王国浩,','许旭健',2,'无记录','RP，去的时候说好了','无耗材',1),(8022,'7223','2011-03-23 20:23:39.0000000','郑锐江,郑宇玲,','郑锐江',2,'宿舍3个人能上网，一个不能上','那个人自己多接了个交换机（还多连了个线到床上），重启他的交换机，ok','无耗材',1),(8023,'1104','2011-03-24 19:17:42.0000000','王国浩,郑锐江,周锦龙,黄永福,杨蓉蓉,','王国浩',2,'全宿舍上不了网','用测线仪测宿舍主线发现1,2号灯没亮，估计是连到交换机的端口出问题。在到楼层交换机把发现该宿舍的网线插口松，重新插过，问题解决。','无耗材',1),(8024,'7609','2011-03-24 19:25:35.0000000','黄永福,丁友军,李艳,王国浩,','黄永福',2,'上不了网','&nbsp;&nbsp; 去到后发现没问题，能上网。不过发现了个叫“木马克星”的东西，导致刚开机屏幕跳动，删掉后就没问题了。','无耗材',1),(8025,'3608','2011-03-25 18:07:07.0000000','王国浩,郑锐江,黄永福,晏超,','王国浩',2,'本地连接打叉','可能软件原因禁用了本地连接，重新启动本地连接，问题解决','无耗材',1),(8026,'1230','2011-03-25 21:02:57.0000000','许旭健,杨蓉蓉,','许旭健',0,'校园网经常断','跟他解释说校园网不稳定，用的人多了，有时就会断；他说太经常了，而且跟室友换了网线还是出现这个问题。查了校园网各项信息，都正确，给他改个设置，把“共享网络”去掉。如果还是觉得有问题，叫他继续报修。 ','无耗材',1),(8027,'9502','2011-03-26 16:46:01.0000000','周锦龙,卢健成,','周锦龙',0,'校园网上不了','dns填错了，改正就行了','无耗材',1),(8028,'4417','2011-03-27 17:08:00.0000000','郑锐江,周锦龙,蔡曼仪,黄永福,','郑锐江',2,'ip冲突','去的时候他不在，他室友打电话给他，他说可以上了，不用修。叫他下次冲突再保修。','无耗材',1),(8029,'4605','2011-03-27 21:53:26.0000000','许旭健,','许旭健',2,'能上Q，能上网，打不开任何邮箱（QQ，飞信，网易等），打不开任何空间（QQ，飞信等)','<PRE>方法一：启用IE浏览器的ActiveX控件执行权限 1. 点击IE浏览器中的“工具”； 2. 选择“internet选项”； 3. 进入“安全”页面，点击“自定义级别”； 4. 对“对标记为可安全执行脚本的ActiveX控件执行脚本”设置为“启用”； 5. 关闭所有IE浏览器，重新打开浏览器再访问QQ空间。 </PRE><PRE>方法二：解决打不开QQ空间的方法 1. 打开一个ie窗口； 2. 点击菜单栏中的“工具”； 3. 选择“interner”选项； 4. 在“常规”页面中点击“删除文件”； 5. 将“删除所有脱机内容”选中； 6. 点击确定； 7. 重新打开空间查看。 </PRE><PRE>方法三：重新注册脚本组件库（此种解决打不开QQ空间的方法最常见有效） 1. 点击“开始”按钮，然后点击“运行”； 2. 在弹出的窗口中输入regsvr32 jscript.dll后选择“确定”； 3. 再次点击“开始”按钮，然后点击“运行”，再次输入regsvr32 vbscript.dll 选择“确定”； 4. 若两次输入都会有注册成功提示，说明您已成功修复您的IE组件； 5. 打开浏览器，选择菜单中的“工具”-&gt;“Internet选项”-&gt;“内容”-&gt;“自动完成”-&gt;将勾全部去掉-&gt;点击“清除表单”和“清除密码”-&gt;确定； 6. 再次打开IE浏览器，选择菜单中的“工具”-&gt;“Internet选项”-&gt;“高级”-&gt;“还原默认”-&gt;确定； 7. 关闭所有IE浏览器，重新打开QQ空间试试。</PRE><PRE>方法四：安装Flash播放器并启用ActiveX控件执行权限 1. 先去下载Flash Player然后安装； 2. 再打开IE菜单-&gt;工具-&gt;Internet选项-&gt;安全-&gt;自定义级别； 3. 找到“ActiveX”一栏分别选 禁用--启用--禁用--启用--禁用--启用--启用； 4. 如果以上已做，还是打不开QQ空间，则按照下面步骤设置（可能是MSXML的问题）； 5. 点击这里下载MSXML 4.0 Service Pack 2，然后安装； 6. 关闭所有IE浏览器，然后再重新打开QQ空间试试。</PRE><PRE>(以上信息由百度提供，当俺试到第三个方法时，问题搞定）</PRE>','无耗材',1),(8030,'6504','2011-03-28 22:31:28.0000000','许旭健,王国浩,蔡曼仪,','许旭健',2,'无记录','RP，去时说好了','无耗材',1),(8031,'4517','2011-03-29 19:15:13.0000000','蔡曼仪,祁有盛,周锦龙,','蔡曼仪',2,'线路有问题','昨晚锦龙师兄去修的时候，不小心把她们宿舍主交换机上的线弄松了，插好，就可以上了。。。','无耗材',1),(8032,'7624','2011-03-29 20:50:06.0000000','许旭健,黄永福,王国浩,','许旭健',2,'这两个星期上网会出现整间宿舍同时断的情况，而且次数不少','她说常见的是在晚上10点整间宿舍断，本地连接打叉。我去时她们能上网，观察她们的交换机，感觉没问题。测主线，8个灯都亮。到楼层交换机看看，找出对应的线刮刮，压压，顺便把线跟7422的对调过来。告诉她，如果换成7422出现她们这种情况，那应该是楼层交换机的问题；否则，很有可能是她们宿舍交换机的问题。','无耗材',1),(8033,'2610','2011-03-30 21:07:47.0000000','许旭健,','许旭健',2,'没有活动的网卡；宽带769','线路没问题；本地连接显示已连上。在任务管理器中，“联网”选项中出现“没有活动的网卡”；宽带无法验证用户名和密码，出现769。找设备管理器，网卡驱动没问题，但另外还有有两个带着黄色感叹号的驱动，怀疑是病毒在作怪，想删但删不了。用360和金山都杀不出毒，把网卡驱动备份好，删了，想重装装不了。进入安全模式弄，也弄不出结果。在运行中输入“services.msc”，查看服务项，有关网络的都没问题。纠结了好久，最后重装系统。 ','无耗材',1),(8036,'2609','2011-04-02 12:26:05.0000000','杨蓉蓉,','杨蓉蓉',0,'电信网和校园网都有一点问题','电信网可以上，只是IE有点问题，重装IE就好了；由于换了台电脑，更改一下物理地址就好了','无耗材',1),(8037,'7609','2011-04-02 20:12:18.0000000','许旭健,','许旭健',2,'有时上网会本地连接打叉，通常是10点后','去的时候能连上。她的线接在交换机的2号端口，怀疑是端口有问题，给她跟别人接的端口对调；然后看到她电脑有点闪屏，给她重装显卡驱动；后来，跟她对调的室友那里就本地连接打叉了，而她自己的不会，验证了我的猜想。给她看了一下交换机，用测线仪测2号端口，123亮，6不亮，接触不良，后来我用镊子稍微弄了一下又好了，跟她说用个小纸条和网线一起插在2号端口，以防松动。至于10点后经常会打叉，很可能是那个1号位的同学上完晚课回来后，碰到了。','无耗材',1),(8039,'4322','2011-04-02 20:28:38.0000000','许旭健,王国浩,黄永福,','许旭健',2,'起初是网页打开很慢，接着是几乎打不开，但QQ能连上','查过代理服务器等等一些设置都没问题；测主线8个灯都亮；后来到楼层交换机看了一下，军哥说那些灯閃得不太正常，因为有几间连到这个楼层交换机的宿舍都上网很慢，有盛说要拔线看一下是不是某间宿舍的交换机出问题，结果看不出来，重启交换机，上网就正常了。','无耗材',1),(8040,'4603','2011-04-02 20:21:48.0000000','黄永福,郑锐江,王曦,','黄永福',2,'整间宿舍上不了网','路由器账号密码没有输入，重新输入就能上了。','无耗材',1),(8041,'4708','2011-04-06 18:16:03.0000000','郑锐江,卢健成,','郑锐江',1,'不能上网，电信拨号错误651','用侧线仪测主线没反应，交换机房的线松了，插紧就ok了。','无耗材',1),(8042,'6421','2011-04-06 18:15:58.0000000','王曦,','王曦',2,'能上q不能上网页','代理是啥我不太知道 反正平常修复一下就行了 今天打开ie设置 取消有个“web proxy。。。什么8580”的选项 就能上了','无耗材',1),(8043,'9111','2011-04-06 19:55:32.0000000','许旭健,黄永福，王国浩','许旭健',2,'本地连接打叉','测主线，没信号；开楼层交换机，发现线被拔出来了，重新插回去；3号灯不亮，模块有问题，拆开，重新打一遍还是不行，看模块接口，8跟金属丝，凹了几根，找不到镊子把它们夹起来，在模块那里塞上小纸条，网线插稳后本地连接就可以连上了。','无耗材',1),(8044,'2530','2011-04-07 18:14:33.0000000','杨蓉蓉,郑宇玲,','杨蓉蓉',2,'上不了网','据舍友反映，该同学的校园网每次开电脑都要重新输入IP地址和网关，可是我们去的时候输入网关和IP地址，她也不可以上，她同学说装了系统后就这样了，可是很奇怪，我们查了她的物理地址是正确的，想不通。最后重装了一下网卡驱动就可以了。','无耗材',1),(8045,'4417','2011-04-07 18:34:44.0000000','郑锐江,许旭健,','郑锐江',2,'ip冲突','昨天去没人在，今天又没人在！！','无耗材',1),(8046,'1408','2011-04-08 17:53:46.0000000','黄永福,王国浩,祁有盛,','王国浩',2,'有时上不了网','线路没问题，密码也没问题，估计是软件冲突导致不定时断线','无耗材',1),(8047,'9105','2011-04-08 18:03:31.0000000','许旭健,蔡曼仪,','许旭健',2,'楼层交换机那边的水晶头氧化','刮刮，压压','无耗材',1),(8048,'4632','2011-04-07 19:42:50.0000000','王曦,蔡曼仪,','王曦',2,'上不了网','还是之前导致整层上不了那个问题 去了好了','无耗材',1),(8049,'4519','2011-04-07 19:44:13.0000000','王曦,蔡曼仪,','王曦',2,'上不了网','还是之前导致整层上不了那个问题 去了好了','无耗材',1),(8050,'1614','2011-04-09 01:27:51.0000000','黄永福,王国浩，祁有盛','黄永福',2,'上不了网','账号密码问题，建议其去修改密码','无耗材',1),(8051,'7122','2011-04-09 15:57:28.0000000','杨蓉蓉,李艳,','杨蓉蓉',2,'整个宿舍上不了网','外面交换机接口松了，重新插好后就可以上了','无耗材',1),(8052,'4619','2011-04-10 20:52:25.0000000','许旭健,','许旭健',2,'无记录','RP，去的时候说好了','无耗材',1),(8053,'6623','2011-04-10 20:52:56.0000000','许旭健,黄永福,','许旭健',2,'上得了QQ，打不开网页','代理服务器的勾去掉','无耗材',1),(8054,'6211','2011-04-11 18:24:27.0000000','王曦,','王曦',0,'校园网上不了','换了主板 物理地址不是原来的了 打电话到网络中心改了 能上了','无耗材',1),(8055,'1609','2011-04-12 18:32:02.0000000','许旭健,王国浩,黄永福,','许旭健',2,'IP冲突','去的时候没IP冲突，拔了他的网线，想让别人抢他的IP先，过了一分钟，把网线插回去，还是没IP冲突，可能之前占了IP的同学没开电脑或把IP改掉了','无耗材',1),(8056,'5429','2011-04-12 18:35:48.0000000','许旭健,黄永福,','许旭健',2,'宽带老是弹出IP冲突','他说出现IP冲突时上网就很卡，跟他们解释是电信分配IP的问题，感觉他们不太情愿让我们走，所以就给他们每个人分配了静态IP','无耗材',1),(8057,'5203','2011-04-13 18:40:28.0000000','郑锐江,祁有盛,','郑锐江',2,'不能上网','去的时候他说好了，不过他说他们附近几间宿舍老是断网，我们叫他下次断网马上call我们过去。。','无耗材',1),(8058,'9516','2011-04-13 20:49:30.0000000','许旭健,','许旭健',2,'楼层交换机那边网线接触不良','刮刮，压压，重新插一遍','无耗材',1),(8059,'2327','2011-04-14 23:13:05.0000000