只有3217和主线闪得飞快，拔掉3217，其他都正常了，插上，又不行，上去又试验了一遍给他们看，最后让他们主线直接接电脑，可以正常上网，问题出在他们的路由上了。','无耗材',1),(8078,'5615','2011-04-24 19:08:39.0000000','杨蓉蓉,祁有盛,','杨蓉蓉',2,'网线拔不出来，上不了网','测网线时1号灯不亮，网线拔不出来，拆了模块才把网线拔出来，结果弄了半天还是1、2号灯都不亮了，最后两边换了一下线序才可以~','无耗材',1),(8079,'5406','2011-04-25 22:50:48.0000000','许旭健,王国浩','许旭健',2,'会有时弹出一个窗口，然后就上不了网','去时能上网。问他窗口里面说什么，他说忘记了；然后在事件查看器看了一下，没问题；留个电话，叫他出问题时找我','无耗材',1),(8080,'3214','2011-04-26 19:03:32.0000000','郑锐江,郑宇玲,','郑锐江',2,'整宿舍不能上网','过去一看是用路由的，线路没问题，找个电脑直接接主线拨号，错误691.。叫他去改密码。','无耗材',1),(8081,'2306','2011-04-26 19:04:41.0000000','郑锐江,蔡曼仪,许旭健,','郑锐江',2,'不能上网。拨号过不了WAN端口','在设备管理器看不到网卡，试着装网卡驱动，不行。最后安装驱动人生，打开驱动人生（他会自动扫描硬件），接着网卡就被扫出来了。重启还是正常，神奇的驱动人生。','无耗材',1),(8082,'9111','2011-04-26 22:24:45.0000000','许旭健,黄永福,周锦龙,','许旭健',2,'本地连接打叉','上次去时是模块里面的8根铁些有几根弹不起来，给它塞个小纸条插网线，本地连接就可以连上。这次去时第一反应就是模块问题，用镊子把铁丝夹起来，2号灯不亮；拆模块，重打模块，还是一样；最后去楼层交换机那里给他换一个端口插，就可以了。','无耗材',1),(8083,'4529','2011-04-27 17:36:08.0000000','王曦,','王曦',2,'上不了网','去了以后她们说没有报修啊？？？！！！','无耗材',1),(8084,'5135','2011-04-28 18:52:32.0000000','王国浩,黄永福,郑锐江,','王国浩',1,'电信上不到网','线路没问题，重建一个宽带连接就上到','无耗材',1),(8085,'7102','2011-04-29 21:16:17.0000000','郑锐江,许旭健,卢健成,','郑锐江',2,'无记录','去了他们说没有保修','无耗材',1),(8086,'3103','2011-05-03 19:52:13.0000000','许旭健,黄永福,','许旭健',2,'整间宿舍上不了','他们宿舍交换机的问题，重启后可以','无耗材',1),(8087,'8517','2011-05-04 20:23:28.0000000','许旭健,','许旭健',2,'能上Q，不能上网','改代理服务器设置','无耗材',1),(8088,'1213','2011-05-04 22:34:21.0000000','周锦龙,许旭健,','周锦龙',2,'本地连接打叉','用测线仪测得所有的灯不亮，水晶头上灰尘很多，刮掉后还是没有反应，重打水晶头也没反应，拆了模块测得模块是没有问题，确定是线有问题，旭健打了根线给他。','无耗材',1),(8089,'3528','2011-05-04 22:40:59.0000000','周锦龙,王曦,','周锦龙',2,'上不了网','她禁用了本地连接，所以上不了，启用后就好','无耗材',1),(8090,'6228','2011-05-05 13:50:18.0000000','卢健成,','卢健成',2,'本地连接没有连上','是电信的用户，打开“网络与共享中心”，发现本地连接初打叉。检查他的手提却是接上网线了，用测线仪检测不通。查找交换机上的接线，原来接错线，他们多出一条网线，将不用的网线接到交换机，而需要用的那条去没有接到交换机。','无耗材',1),(8091,'2426','2011-05-05 15:35:06.0000000','许旭健,郑锐江,杨蓉蓉,王曦,','许旭健',2,'宽带能连上，不能上网和上Q，ping百度却能ping得通','查看代理服务器设置，没问题。换个firefox也不行。重建宽带也不行，该物理地址，速度和双工模式，分配个IP给它也不行。重装网卡驱动不行。用winsockfix不行。换网线，直接插主线也不行。\r\n最终，重装internet协议就行了。方法如下：\r\n1、开始——运行——regedit.exe，打开注册表编辑器，删除以下两个键：\r\n      HKEY_LOCAL_MACHINE\\System\\CurrentControlSet\\Services\\Winsock \r\n      HKEY_LOCAL_MACHINE\\System\\CurrentControlSet\\Services\\Winsock2\r\n\r\n2、用记事本打开C:\\windows\\inf\\nettcpip.inf文件（找不到此文件的话，xp试着到“工具——文件和文件夹选项——查看”把隐藏文件显示出来；win7试着到“组织——文件和搜索选项——查看”把隐藏文件显示出来），找到：\r\n     [MS_TCPIP.PrimaryInstall]\r\n      Characteristics = 0xa0      <------把此处的0Xa0改为0x80 保存退出 (如果是2000系统,这里已经是0x80了,跳过此步)\r\n\r\n3、本地连接属性——internet协议——安装——协议——添加——从磁盘安装——浏览（找到C:\\windows\\inf\\nettcpip.inf）——确定——选internet协议再确定\r\n 经过这一步之后，又返回网络连接的窗口，但这个时候，那个“卸载”按钮已经是可用的了。点这个“卸载”，重启。（到了这一步，已经就可以上网了。不过没了internet协议，没有可以填IP和DNS的设置了。）\r\n\r\n4、重启后，把C:\\windows\\inf\\nettcpip.inf文件改回来。本地连接属性——internet协议（此时，它变成Microsoft internet（TCP/IP）协议，名称变了），继续点卸载，重启后，它又变成internet协议（变回原来的名字了）。这时又有可以填IP和DNS的设置了。','无耗材',1),(8092,'6119','2011-05-05 17:41:41.0000000','蔡曼仪,李艳,','蔡曼仪',2,'上不了网','去的时候她们说好了。。。','无耗材',1),(8093,'9625','2011-05-05 17:43:24.0000000','蔡曼仪,卢健成,','蔡曼仪',2,'凌晨定时断网','去的时候没人在。。。','无耗材',1),(8094,'8237','2011-05-05 18:26:06.0000000','蔡曼仪,卢健成,','蔡曼仪',2,'上不了网','去的时候没人在。。。','无耗材',1),(8095,'6609','2011-05-05 18:26:53.0000000','蔡曼仪,李艳,','蔡曼仪',2,'有时断网','去的时候说没断，让她断的时候再打电话。。。','无耗材',1),(8096,'6628','2011-05-05 18:28:55.0000000','蔡曼仪,李艳,','蔡曼仪',2,'无记录','去的时候她们说没报修。。。','无耗材',1),(8097,'7325','2011-05-05 18:32:55.0000000','郑锐江,王国浩,','郑锐江',2,'不能上网','去了2次都没人在\r\n','无耗材',1),(8098,'5420','2011-05-05 18:36:55.0000000','丁友军,李艳,','丁友军',2,'上不了网','网络地址错误','无耗材',1),(8099,'7408','2011-05-05 18:37:27.0000000','丁友军,李艳,','丁友军',2,'上不了网','电脑的问题，tcp/ip协议被破坏，重新装协议后解决','无耗材',1),(8100,'9121','2011-05-05 18:38:13.0000000','丁友军,李艳,','丁友军',2,'上网时断时续','楼层交换机接口接触不良，换了一个借口给他','无耗材',1),(8101,'2620','2011-05-05 20:50:22.0000000','杨蓉蓉,','杨蓉蓉',0,'新办的校园网不能上','没有启用本地连接，启用后可以上','无耗材',1),(8102,'3614、3624','2011-05-05 20:51:09.0000000','杨蓉蓉,','杨蓉蓉',2,'每周五14:30到16:00会断网','去的时候已经好了，留了电话，下次断的时候再去','无耗材',1),(8103,'3614/3624','2011-05-05 20:51:09.0000000','杨蓉蓉,','杨蓉蓉',2,'每周五14: