,(8121,'2312','2011-05-09 19:15:33.0000000','郑锐江,许旭健,卢健成,','郑锐江',2,'能上网，打不开qq','打开qq时老是提示“由于应用程序不正确，应用程序未能启动。重装安装应用程序可能会纠正这个问题”电脑问题。怀疑中毒。杀毒，重装vc++2005，重装qq，还是不行。查看服务Windows Installer不见了，运行msiexec/regserver，该服务正常出现，还是不能开qq。搞了很久，最后还是重装系统了。','无耗材',1),(8122,'4301','2011-05-11 19:33:40.0000000','许旭健,卢健成,王国浩,蔡曼仪,','许旭健',2,'629','账号记错了','无耗材',1),(8123,'1125','2011-05-12 18:37:39.0000000','郑锐江,许旭健,黄永福,','郑锐江',2,'整宿舍不能上网','昨晚查ip时，查到是他们宿舍，拔掉他们宿舍的线。今天过去看，那个电信网的同学没有占用校园网ip，估计是后来改回去的。打开事件查看器，发现昨天他确实占用了222.200.48.123的ip。叫他写检讨书去网络中心不然不给上网。','无耗材',1),(8124,'1213','2011-05-12 18:40:30.0000000','郑锐江,黄永福,许旭健,','郑锐江',2,'不能上网，本地连接显示受限制或者没连接','线路没有问题，不过拨号过不了Wan端口。后来改了下物理地址就可以了。回来后我在想，会不会是因为他占用了别人的ip所以被网络中心禁了物理地址。（这可能性很大，想回去看他物理地址，可惜已经没人在了）下次遇到这种问题要记录下他的物理地址，报给网络中心，查看是不是占用了校园网ip而被禁了。','无耗材',1),(8125,'9125','2011-05-12 22:38:32.0000000','杨蓉蓉,王曦,','杨蓉蓉',2,'上不了网','外面楼层交换机接口松了，安好后就可以上网了~','无耗材',1),(8126,'6203-6231','2011-05-13 21:07:06.0000000','许旭健,蔡曼仪,王国浩,晏超,','许旭健',2,'整层上不了网','换了个新的交换机，还是不行。一看那些灯个个表情呆滞，很明显就是有问题。借台笔记本，直接接楼层交换机的主线，能连上。把主线插回去，再拿一根线直接接交换机，另一端接笔记本。如果它是校园网的，直接ping百度，拔线（中间最好拔一次线，就本地连接禁用启用一次），拔到哪根线可以ping得通，就是那间宿舍的交换机导致的。如果是电信网，看宽带连接能否验证用户名和密码，中间最好拔一次线，就本地连接禁用启用一次，拔到能验证为止。最后确定是6231交换机的问题。','无耗材',1),(8127,'3227','2011-05-13 21:18:30.0000000','王国浩,许旭健,','王国浩',2,'上不到网本地连接感叹号','测线没问题，而且他的电脑在舍友的位置上能够上，于是换了条网线，能上，再用原来那条也能上','无耗材',1),(8128,'6421','2011-05-13 21:18:59.0000000','许旭健,杨蓉蓉,蔡曼仪,晏超,','许旭健',2,'她说有时会整间宿舍都断网','去的时候，测主线，1号灯不亮。下去跟阿姨拿网络箱钥匙后上去，8个灯全亮。要么是他们宿舍那根主线有问题，要么就是主线接交换机端口那边的水晶头氧化较严重或端口问题。很蛋疼的是，钥匙插进去能转，却不能打开锁头，它生锈严重，最终只能放弃了。给她留个电话，叫她出问题时可以直接接主线看看，不行再打电话。下次我肯定拿个锤子把它给砸了！','无耗材',1),(8129,'3609','2011-05-13 21:38:32.0000000','祁有盛,','祁有盛',2,'上不了网','开始去是本地连接被禁用，启用后可以上，走后说又不能上了，再回去看，发现本地连接的IP地址没有添，帮忙填写后就可以了','无耗材',1),(8130,'3705','2011-05-16 13:53:02.0000000','周锦龙,郑锐江,蔡曼仪,晏超,','周锦龙',0,'校园网上不了','因为换了张主板物理地址变了所以上不了，由于查找不到她的以前的物理地址，抄了她的现在的物理地址让她第二天到网络中心更改','无耗材',1),(8131,'3512','2011-05-16 13:57:32.0000000','周锦龙,王国浩,','周锦龙',2,'ip冲突','在她的事件管理器中查到与她IP冲突的那位同学（即盗用了她IP的）的物理地址，报告到网络中心让杨工封了，然后就可以上网了','无耗材',1),(8132,'2522','2011-05-16 14:04:56.0000000','周锦龙,王曦,卢健成,','周锦龙',2,'上不了网','听她说是新买的电脑，宽带用户，一直都上不了网，通过不了wan端口，本地连接是连上的，判断不是线路问题，发现她用的杀软是McAfee，检查发现她启用了防火墙锁定（阴止计算机入站和出站Internet访问），点击禁用防火墙锁定即可','无耗材',1),(8133,'4201','2011-05-16 14:12:14.0000000','周锦龙,','周锦龙',2,'有时会断网，678','发现交换机接口上的水晶头接触不是很好，交换了下水晶头的位置，叫他们以后上不了网看看是不是水晶头接触的问题','无耗材',1),(8134,'8525','2011-05-16 18:40:57.0000000','许旭健,','许旭健',2,'629','打10000，账号过期','无耗材',1),(8135,'8327','2011-05-16 22:05:57.0000000','许旭健,郑宇玲,','许旭健',2,'能上Q 不能上MSN 不能上网','打开浏览器，“工具——internet选项——连接——局域网设置“，把前面的勾都去掉，再去，“工具——internet选项——连接”的对话框中双击“宽带连接”也把前面的勾都去掉。都把代理服务器去掉。','无耗材',1),(8136,'2121','2011-05-17 19:02:26.0000000','许旭健,李艳,','许旭健',2,'629','账号过期','无耗材',1),(8137,'1112','2011-05-17 20:40:15.0000000','祁有盛,周锦龙,','祁有盛',2,'上不了网','新办的校园网，IP冲突，查到是1631的宿舍的，去那间宿舍，同学认错态度较好，就没有断网惩罚','无耗材',1),(8138,'1406','2011-05-17 20:42:53.0000000','祁有盛,周锦龙,','祁有盛',2,'上不了网','很久以前办的校园网，应该是办了就不能上，他以为是ARP攻击，一直用电信网，今天去发发现以前办校园网的时候物理地址报错了，帮忙修改了下物理地址','无耗材',1),(8139,'8405','2011-05-18 19:30:01.0000000','许旭健,蔡曼仪,王国浩,','许旭健',2,'无记录','RP大大D，没人在','无耗材',1),(8140,'4116','2011-05-19 17:51:35.0000000','郑锐江,','郑锐江',2,'IP冲突','IP：222.200.56.46\r\n与他冲突的物理地址：\r\n00-23-54-70-6C-74','无耗材',1),(8141,'1406','2011-05-18 17:52:51.0000000','郑锐江,祁有盛,','郑锐江',2,'IP冲突','打电话到网络中心，杨工帮他重新分配了一个ip。填上并将冲突物理地址抄下，明天带回网络中心。','无耗材',1),(8142,'6421','2011-05-19 19:01:59.0000000','王国浩,黄永福,','王国浩',2,'上不了网','没啥好说，宿舍内部矛盾，其他人不给她把网线插到路由器接口处，我们让他买台交换机，直接连主线，再把路由器和她的网线直接连在交换机插处。','无耗材',1),(8143,'3531','2011-05-19 22:54:57.0000000','王曦,','王曦',2,'上不了网','去了说已经好了','无耗材',1),(8144,'9111','2011-05-20 11:49:59.0000000','许旭健,杨蓉蓉,','许旭健',2,'接交换机那里的线松了','无记录','无耗材',1),(8145,'6327','2011-05-21 16:43:50.0000000','卢健成,黄永福,','卢健成',1,'电信拨号已经连接上，但是不能上网','被恶意软件破坏，用360LSP修复工具可以解决','无耗材',1),(8146,'7106','2011-05-22 11:20:14.0000000','许旭健,王国浩,黄永福,','许旭健',2,'无记录','RP大大D，人不在','无耗材',1),(8147,'7312','2011-05-22 11:20:55.0000000','许旭健,王国浩,黄永福,','许旭健',2,'629','账号问题，叫她去改密码','无耗材',1),(8148,'5507','2011-05-22 11:22:55.0000000','许旭健,王国浩,黄永福,郑锐江,','许旭健',2,'其交换机导致整层上不了网','去拔线时人不在，第二天把线接回去后人也不在，观察5分钟，楼层交换机的灯闪得正常，应该他们的交换机只是暂时读死而已','无耗材',1),(8149,'2518','2011-05-16 23:04:28.0000000','章柳洵,','章柳洵',2,'上不了网','线松了，接上就好了','无耗材',1),(8150,'2528','2011-05-16 23:05:41.0000000','章柳洵,','章柳洵',2,'开不了机','显示smart错误，貌似是硬盘的问题，但是原来是好的，bios里面没有相关设置，后来，重装了。','无耗材',1),(8151,'7214','2011-05-23 18:19:12.0000000','丁友军,李艳,','丁友军',2,'上不了网','经检测是网线坏了，换条网线即可','无耗材',1),(8152,'6211','2011-05-24 18:45:45.0000000','李艳,','李艳',2,'上不了网','本地连接被禁用，启用之后就可以上了。','无耗材',1),(8153,'6510','2011-05-24 18:46:32.0000000','李艳,','李艳',2,'qq可以登录，网页打不开','由于电脑开机和反应都很慢，所以禁用了一些启动项。然后重置了ie里的设置，就可以了。','无耗材',1),(8154,'3608','2011-05-24 22:39:41.0000000','祁有盛,蔡曼仪,黄永福,','祁有盛',2,'打不开网页','可以上QQ，也可以上网，但是打开网页会自动转到一个电信的提示页面，提示说，不允许共享上网什么的。（但也不是一直时，有时候会提示）她是校园网，后来发现他没有设置校园网IP，也没有连接电信宽带，宿舍也没有使用路由器，但是可以上网，后来帮她重新设置了校园网IP，应该不会再提示了吧。','无耗材',1),(8155,'1220','2011-05-25 18:12:13.0000000','郑锐江,祁有盛,','郑锐江',2,'不能上网。拨号过不了WAN端口','一去就怀疑是前天封物理地址的那个，打开事件查看器——被清空了。。。老鸟。查看物理地址00-03-0D-D3-E4-64就是占用校园网ip的。。叫他写检讨书，明天交网络中心。。','无耗材',1),(8156,'5429','2011-05-25 19:20:29.0000000','许旭健,卢健成,周锦龙,','许旭健',2,'vista的815','线路没问题，账号没问题，就是宽带不能验证用户名和密码，分配固定IP，改物理地址，改速度和双工模式，关防火墙，重建宽带都不行；重装网卡驱动也不行；估计电脑中毒了，有些莫名奇妙的进程，想重装internet协议，却重装不了；最终放弃，建议其重装系统','无耗材',1),(8157,'3110','2011-05-25 21:19:56.0000000','周锦龙,蔡曼仪,','周锦龙',2,'整层上不了网','早上的时候整层上不了网，杨工已经查到是编号是204的房间的问题导致的，已经在把网线拔了。我们去的时候把线插回去再拔掉3125其他的宿舍还是上不了，而且接回去3125也上不了，用测线仪测得3125前不是对应204的宿舍（编号标错了）。204对应的时1327，发现他们的交换机是小小的那种，应该就是那个交换机出现了问题，叫他们换个交换机。','无耗材',1),(8158,'4323','2011-05-26 11:14:02.0000000','王国浩,黄永福,','王国浩',2,'有时上不了网','我们去到的时侯能上，而且平时就他一个人出问题，我们建议他如果再出现这样情况就把宿舍交换机的端口跟别人换换，如果还不行再用舍友的网线看看，还不行再打电话报修。','无耗材',1),(8159,'8312','2011-05-30 17:32:01.0000000','王曦,','王曦',2,'上不了网','解决','无耗材',1),(8160,'7512','2011-05-30 17:33:15.0000000','王曦,','王曦',2,'上不了网','解决','无耗材',1),(8161,'7409','2011-05-30 17:33:50.0000000','王曦,','王曦',2,'上不了网','解决','无耗材',1),(8162,'3117','2011-05-30 17:34:45.0000000','王曦,','王曦',2,'上不了网','解决','无耗材',1),(8163,'7318','2011-05-22 17:39:42.00000