.000000','登陆系统提示错误','windows xp 到了用户登陆界面后就提示winlogin.exe 出现错误，问题是IE8卸载不干净，进入注册表删除两项文件就好了。','张灼武','张灼武'),(752,'107','1078','2010-04-01 16:57:05.000000','蓝屏，出现错误代码','<P>经过检查还是内存出现问题，提示0x0000008e出错。后发现电脑里面的1G金士顿内存是翻新条，存在严重的质量问题。</P>','张灼武','张灼武'),(753,'113','113','2010-04-01 16:59:09.000000','要求重装系统','VISTA转换XP','张灼武','张灼武'),(754,'348','348','2010-04-01 16:59:37.000000','开不了机','内存出问题拔出换槽，重新按紧就好了~！','张灼武','张灼武'),(755,'459','郭老师','2010-04-01 17:00:23.000000','快捷方式打开出错','无法找到脚本文件C:\\Program Files\\Winrar\\Monitor.jse”\r\n<P>下面是解决这个问题的方法：</P>\r\n<P><BR>1：手动删除以下注册表文件即可:<BR><BR>单击开始菜单 - 运行 - regedit.exe<BR><BR>[HKEY_CLASSES_ROOT\\lnkfile\\shell\\open\\command]<BR><BR>右边的\"C:\\\\WINDOWS\\\\System32\\\\WScript.exe\\\"</P>\r\n<P>2：如果再回到打开桌面图标时出现：<BR><BR>“该文件没有程序与之关联来执行该操作，请在控制面板的文件夹选项中创建关联”字样时的解决方法为以下：需要修复注册表，在桌面上新建个文本文档，</P>\r\n<P>将下面代码复制进去</P>\r\n<P>Windows Registry Editor Version 5.00 </P>\r\n<P>[HKEY_CLASSES_ROOT\\.lnk] </P>\r\n<P>@=\"lnkfile\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\.lnk\\ShellEx] </P>\r\n<P>[HKEY_CLASSES_ROOT\\.lnk\\ShellEx\\{000214EE-0000-0000-C000-000000000046}] </P>\r\n<P>@=\"{00021401-0000-0000-C000-000000000046}\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\.lnk\\ShellEx\\{000214F9-0000-0000-C000-000000000046}] </P>\r\n<P>@=\"{00021401-0000-0000-C000-000000000046}\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\.lnk\\ShellEx\\{00021500-0000-0000-C000-000000000046}] </P>\r\n<P>@=\"{00021401-0000-0000-C000-000000000046}\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\.lnk\\ShellEx\\{BB2E617C-0920-11d1-9A0B-00C04FC2D6C1}] </P>\r\n<P>@=\"{00021401-0000-0000-C000-000000000046}\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\.lnk\\ShellNew] </P>\r\n<P>\"Command\"=\"rundll32.exe appwiz.cpl,NewLinkHere %1\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile] </P>\r\n<P>@=\"快捷方式\" </P>\r\n<P>\"EditFlags\"=dword:00000001 </P>\r\n<P>\"IsShortcut\"=\"\" </P>\r\n<P>\"NeverShowExt\"=\"\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\CLSID] </P>\r\n<P>@=\"{00021401-0000-0000-C000-000000000046}\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\shellex] </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\shellex\\ContextMenuHandlers] </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\shellex\\ContextMenuHandlers\\Offline Files] </P>\r\n<P>@=\"{750fdf0e-2a26-11d1-a3ea-080036587f03}\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\shellex\\ContextMenuHandlers\\{00021401-0000-0000-C000-000000000046}] </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\shellex\\DropHandler] </P>\r\n<P>@=\"{00021401-0000-0000-C000-000000000046}\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\shellex\\IconHandler] </P>\r\n<P>@=\"{00021401-0000-0000-C000-000000000046}\" </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\shellex\\PropertySheetHandlers] </P>\r\n<P>[HKEY_CLASSES_ROOT\\lnkfile\\shellex\\PropertySheetHandlers\\ShimLayer Property Page] </P>\r\n<P>@=\"{513D916F-2A8E-4F51-AEAB-0CBC76FB1AF8}\" </P>','张灼武','张灼武'),(756,'办公楼138','周老师','2010-04-06 15:07:55.000000','网页里的输入框打不开','换浏览器也不行， 用360修复也不行，删除COOKIES重启后可以了','周斌','周斌'),(757,'103','103','2010-04-06 15:46:37.000000','开机进不了系统卡在windows xp loading','在wndows xp loading 画面花屏，开机箱后发现显示卡非常热，后来清理一下灰尘就可以进入系统了。进系统后经用显示卡驱动。正常','张灼武','张灼武'),(758,'办公楼348','孙老师','2010-04-07 14:30:00.000000','开不了机','内存松了，重接','周斌','周斌'),(759,'办公楼211','黄老师','2010-04-07 14:30:32.000000','开不了机','内存松，重接','周斌','周斌'),(760,'413','413','2010-04-07 17:38:12.000000','系统中毒','U盘文件给隐藏了，系统没有中毒~！','张灼武','张灼武'),(761,'办公楼216','田老师','2010-04-08 10:19:40.000000','系统运行慢，中毒','<P>机主本人要重装系统</P>','周斌','周斌'),(762,'办公楼406','吴老师','2010-04-08 13:42:44.000000','U盘打不开','用360一键优化后正常','周斌','周斌'),(763,'办公楼519','徐老师','2010-04-09 15:30:15.000000','设置无线路由','<P>1.因为改了无线密码怎么都进不去，打开无线时发现没有任何信号，检查后发现她安装了TP-LINK无线客户端，调整到WINDOWS后正常。</P>\r\n<P>2.开机后文件写入--原来是她有一个文件放到光驱里烧录时没发现光盘</P>\r\n<P>3.U盘里的图片打不开，后来试三台机器都是正常。</P>','周斌','周斌'),(764,'办公楼152','谢老师','2010-04-09 15:34:04.000000','网络打印不了','网络打印不了原来是GUEST账号被360禁用了，启用后正常','周斌','周斌'),(765,'办公楼156','刘老师','2010-04-09 15:34:55.000000','网络打印用不了','他使用360时禁用了GUEST账号，启用后正常','周斌','周斌'),(766,'b203','b203','2010-04-10 09:19:32.000000','开不了机','<P>去到有学生已检测过，换内存都没法启动电脑，怀疑电脑坏了，联系了科蓉</P>','张灼武','张灼武'),(767,'红楼206','胡老师','2010-04-10 09:21:00.000000','无法开机','<P>实验室的电脑无法开始，因为内存松了，换槽重新按紧就好。</P>\r\n<P>红楼研究生办公室，三台电脑都不能正常开机，电脑A缺内存，电脑B坏电源，电脑三坏显示卡，把三台电脑配件互换一下，有两台能正常使用。</P>','张灼武','张灼武'),(768,'472','472','2010-04-13 09:23:26.000000','报系统中毒','系统是有点乱，乱七八糟的插件组件装了一打堆,最后重装系统。 ','张灼武','张灼武'),(769,'103','103','2010-04-13 09:23:49.000000','上不了网','本地连接被禁用，本地连接里填写了学生宿舍的IP段，导致不能上网，最后吧本地连接改城自动获取IP就能上了。','张灼武','张灼武'),(770,'348','孙老师','2010-04-13 09:25:38.000000','共享打印机','<P>电脑B打印机驱动重新安装，后共享就没问题了</P>','张灼武','张灼武'),(771,'419','419','2010-04-13 09:27:44.000000','开不了机','应该是天气太潮湿了，叫助理自己拿风筒吹一下电源跟主机看看。','张灼武','张灼武'),(772,'红楼205','205','2010-04-13 09:28:56.000000','系统提示缺少文件','系统提示缺少windows/system，进入PE蓝屏提示代码位 0x0000007e,0x00000050 每次都不一样，显示卡很汤，确定是硬件问题。','张灼武','张灼武'),(773,'办公楼111学工处','无记录','2010-04-15 15:08:28.000000','上网问题，部分网页打不开','需要安装ADOBE flash player,IE屏弊了自动安装，没安装，学生处网页打不开','周斌','周斌'),(774,'办公楼321','孔老师','2010-04-16 07:54:28.000000','上不了网','DNS与代理有问题','周斌','周斌'),(775,'办公楼429','王文峰老师','2010-04-23 15:52:38.000000','IP冲突','被他人占用IP，占用端口为北5-2/0/24，封了其MAC','周斌','周斌'),(776,'办公楼321','孔锐老师','2010-04-23 15:54:04.000000','IP冲突','5楼2/0/9，封了MAC后正常','周斌','周斌'),(777,'办公楼112','陈绍鹏老师','2010-04-26 09:08:11.000000','系统问题','<P>只有一个C，HP机型，肯定用过一键还原所致，用PM分区表医生重建分区表，用XP安装盘安装系统。</P>','周斌','周斌'),(778,'103','103','2010-04-26 15:35:17.000000','开不了机','cpu底座有问题。内存插了跟拔出响声一样。。建议换主机','张灼武','张灼武'),(779,'b104','b104','2010-04-26 15:36:08.000000','课室电脑中毒','两个课室都是中了U盘病毒，病状把原文件隐藏生成相同的文件后加.exe，使用贝壳就能完全清除病毒了。','张灼武','张灼武'),(780,'459','459','2010-04-26 15:38:55.000000','死机','大概是显示卡问题。蓝屏后花屏什么提示都看不了。只能先观察一段时间。','张灼武','张灼武'),(781,'心理咨询室','心理咨询室','2010-04-26 15:39:59.000000','用不了无线上网','<P>弄了半天才发现他本本的无线驱动装错了。到hp官网下载最新驱动装上问题就解决了。</P>','张灼武','张灼武'),(782,'B104','B104','2010-04-26 15:41:27.000000','系统故障','外语实践中心办公室，主机系统有问题，重装系统后正常。','张灼武','张灼武'),(783,'164','164','2010-04-26 15:42:10.000000','开不了机','<P>显示卡松了拔出重插就好了</P>','张灼武','张灼武'),(784,'514','杨雨丹','2010-04-27 09:48:51.000000','上不了网','有可能是老师清理磁盘空间的时候把网卡驱动给卸载了，重启动后发现网络连接里面的本地连接变成2，还自动获取IP导致不能上网，后来重新填入IP就好了~！','张灼武','张灼武'),(785,'104','贾老师','2010-04-29 08:21:35.000000','打印机不能打印','打印机驱动出问题，重新安装驱动设置一下就好','张灼武','张灼武'),(786,'103','103','2010-04-29 10:51:08.000000','显示器无法显示','怀疑是显示器问题，突然又自动有显示','张灼武','张灼武'),(787,'办公楼112','林老师','2010-04-29 11:15:15.000000','系统中毒','将SP2升级至SP3，瑞星删除，改装为360，用360扫描，删除木马','周斌','周斌'),(788,'办公楼122','钟老师','2010-04-29 11:17:04.000000','网络打印用不了','<P>网络打印用不了，原来那台网络打印的电脑为2000，而且杀毒软件装不了。</P>\r\n<P>1.加256内存，重装系统后发现USB打印线也坏了</P>\r\n<P>2.那台机有K3的工资系统，重装后可以正常用。（被K3工程师忽悠了，安装虚拟机后不能识别加密狗）</P>\r\n<P>3.设置用户名与工作组后，K3又得进入账套管理里修改账套属性，更改数据库</P>\r\n<P>&nbsp;</P>','周斌','周斌'),(789,'办公楼156','刘老师','2010-04-29 11:22:20.000000','网络打印不了','<P>1.guest用户可能在360优化的时候被用户禁止了</P>\r\n<P>2.360服务项里PTINT SP被禁止</P>','周斌','周斌'),(790,'107','107','2010-04-29 17:19:11.000000','开不了机','<P>主板上的PS/2接口有问题。导致键盘不能使用，后不能进入系统</P>','张灼武','张灼武'),(791,'422','422','2010-04-29 17:20:18.000000','开不了机','机箱开机后有一股烧焦味道，后拔出内存换槽重插就好了','张灼武','张灼武'),(792,'418','418','2010-05-04 09:35:57.000000','上不了网','<P>能ping通不能访问网页，上QQ等软件，运行360安全位置里面的LSP修复工具修复一下网络协议后就能正常使用，清理了注册表跟卸载了无用组件等等。</P>','张灼武','张灼武'),(793,'164','164','2010-05-06 08:11:35.000000','开不了机','<P>显示卡过热,后把出内存重插就可以进系统,由于系统太慢后重装.</P>','张灼武','张灼武'),(794,'招待所709','管理员','2010-05-06 08:13:28.000000','上网断断续续','由于没有电脑测试,只换了条新的网线.','张灼武','张灼武'),(795,'办公楼122','陈老师','2010-05-06 09:16:29.000000','系统运行慢','<P>她用的瑞星，更换为360，关闭无用启动项后正常</P>','周斌','周斌'),(796,'139','藤老师','2010-05-07 10:31:05.000000','开机慢','<P>系统没啥问题就是硬盘传输速度慢，做一下注册表优化有速度明显有提升。</P>','张灼武','张灼武'),(797,'421','421','2010-05-07 10:33:25.000000','进不了系统','BIOS提示错误，设置BIOS载入出厂设置后就能进入系统了，最后坏电子没电。经常出现这情况。','张灼武','张灼武'),(798,'财务科','财务科','2010-05-07 10:34:40.000000','打印机不能打印','财务软件出了点问题，老是提示无响应，关闭软件后重新登录就好了','张灼武','张灼武'),(799,'办公楼133','邹老师','2010-05-10 09:17:44.000000','进不了系统','无法找到系统盘，是她把系统文件放入到了回收站，用PE还原','周斌','周斌'),(800,'办公楼138','周老师','2010-05-13 10:38:49.000000','安装打印机','驱动装上后，打印机不能使用，前后盖未盖好。','周斌','周斌'),(801,'b210','b210','2010-05-13 10:40:55.000000','上不了网','ADSL的电话线有问题，住线没接上。','张灼武,周斌','张灼武'),(802,'350','350','2010-05-13 10:42:22.000000','上不了网','<P>助理电脑没申请IP，乱填IP导致IP冲突。建议买个路由器</P>','张灼武,周斌','张灼武'),(803,'162','162','2010-05-13 10:44:03.000000','上不了网','接线，D36接口接网线没反映，只能把D35的电话线接口换到D36','张灼武','张灼武'),(804,'164','邱老师','2010-05-13 10:45:11.000000','word不能打开','<P>注册表修复就好了</P>','张灼武','张灼武'),(805,'招待所413','413','2010-05-14 16:00:54.000000','开不了机','去到清洁啊姨以弄好能开机了','张灼武','张灼武'),(806,'413','413','2010-05-14 16:02:13.000000','不能上网','待机状态后本地连接打叉，有可能是系统问题后来修复一下系统没出现这问题了','张灼武','张灼武'),(807,'166','黄老师','2010-05-14 16:03:33.000000','设置路由','测试路由有没有坏，设置后路由能正常工作，硬件没问题','张灼武','张灼武'),(808,'167','周老师','2010-05-14 16:04:31.000000','电脑中毒IE不能打开','系统安装了一个病毒软件，有给360杀了，导致HOST 脚本指向出错，用路径修复软件修复一下就好了','张灼武','张灼武'),(809,'办公楼216','田老师','2010-05-17 09:09:34.000000','电脑文件丢失','用软件恢复，U盘文件剪切之后找不到','周斌','周斌'),(810,'办公楼231','刘老师','2010-05-19 14:51:27.000000','OA有问题','<P>OA有问题里无签名项，在文件菜单里有，可能是字体的原因。</P>\r\n<P>用遨游会出错，用360正常</P>','周斌','周斌'),(811,'办公楼137','熊老师','2010-05-19 14:52:49.000000','网络打印不了','用户在360里禁用了GUEST','周斌','周斌'),(812,'107','107','2010-05-24 10:21:29.000000','开不了机','<P>显示卡很热，后来拔出显示卡用纸刷了一下金手指后重新插会就没死机了</P>','张灼武','张灼武'),(813,'457','457','2010-05-24 10:22:45.000000','开不了机','内存有问题，拔出重新插回就好了~！','张灼武','张灼武'),(814,'470','470','2010-05-24 10:23:24.000000','上不了网','本地连接被禁用了，启动就可以了','张灼武','张灼武'),(815,'471','471','2010-05-24 10:23:56.000000','进不了系统','PE都进不了系统。30秒左右显示屏幕就显示黑屏了，联系售后服务来检查。','张灼武','张灼武'),(816,'111','111','2010-05-24 10:25:02.000000','上不了网','都是0.183代理问题，去掉就可以','张灼武','张灼武'),(817,'164','164','2010-05-24 10:25:40.000000','开不了机','显示卡问题，经常自动出问题，导致开不了机，拔出重新插回就好了','张灼武','张灼武'),(818,'办公楼162','廖老师','2010-05-24 14:57:13.000000','上网很慢，经常死机','<P>优化开机程序，关闭不需要的服务</P>','周斌','周斌'),(819,'办公楼321','张老师','2010-05-24 14:59:00.000000','电脑中毒，数据无法更新','学生就业网的数据录入后，无法更新百分比，用360系统修复IE后正常','周斌','周斌'),(820,'办公楼139','腾老师','2010-05-27 09:24:08.000000','安装网络','<P>办公室增加一台电脑上网，安装一台路由器，增加两条网线。</P>\r\n<P>安装网络打印机时计算机名不正确。删除打印机，两台都重启后再安装正常</P>','周斌','周斌'),(821,'办公楼508','危老师','2010-05-27 16:12:55.000000','上不了网','<P>MAC被封了，解封后将IP绑定在交换机上202.116.25.141</P>','周斌','周斌'),(822,'办公楼216','田老师','2010-05-28 08:03:06.000000','安装OFFICE 2007','安装OFFICE 2007，不是用SETUP，用另一个UP***.EXE,优化系统','周斌','周斌'),(823,'办公楼154','刘老师','2010-05-28 08:04:32.000000','一卡通网络不通','<P>先将网线接电脑也不通，网线另一端接交换机，状态一样。断定网线有问题，更换</P>','周斌','周斌'),(824,'101','101','2010-06-04 15:39:13.000000','电脑中毒要求重装系统','<P>一步步安装系统，安装软件。做系统备份</P>','张灼武','张灼武'),(825,'107','107','2010-06-04 15:40:07.000000','电脑蓝屏','<P>停止代码为0x000000c2</P>\r\n<P>估计硬件问题，显示卡非常热，拔出显示卡刷干净显示卡的金手指，和AGP槽后重新插回就好了。</P>\r\n<P>计算管理-&gt;事件查看器中-&gt;有一项目提示红色警告，不能启动，运行输入lodctr /r修复一下就好了。</P>\r\n<P>&nbsp;</P>','张灼武','张灼武'),(826,'103','103','2010-06-07 10:18:57.000000','硬件升级','过去写俩份配置单','张灼武','张灼武'),(827,'办公楼214','张老师','2010-06-09 16:20:19.000000','系统运行慢','IE被改，开机有木马，用清理助手与360查杀。','周斌','周斌'),(828,'办公楼122','陈老师','2010-06-09 16:24:54.000000','安装财务软件客户端','安装用友通与科发客户端','周斌','周斌'),(829,'104','贾老师','2010-06-11 14:44:54.000000','开不了机','学生助理电脑内存槽又问题，换内存一样报警，又来拔出内存刷一下内存槽就好了，设置打印机共享，学生助理电脑经常禁用GUEST导致共享失败。','张灼武','张灼武'),(830,'办公楼471','杨老师','2010-06-12 09:35:06.000000','系统故障','系统重装并安装360','周斌','周斌'),(831,'办公楼212','林老师','2010-06-13 11:27:13.000000','电脑运行太慢','重装后发现，启动特别慢，咨询联系半个小时没答案，让他们想到答案再告知，打开机厢帮他接光驱，接上光驱后正常，之前换电源时所造成','周斌','周斌'),(832,'164','164','2010-06-17 09:54:06.000000','接线','接网线，设置打印机','张灼武','张灼武'),(833,'212','林主任','2010-06-17 09:57:50.000000','IE问题','清理百度工具条，360绑定IE浏览器','张灼武','张灼武'),(834,'211','黄老师','2010-06-17 09:58:45.000000','开不了机','<P>内存问题拔出来换槽就行了，机器很慢卸载杀毒工具，安装360安全浏览器</P>','张灼武','张灼武'),(835,'419','外语系办室','2010-06-17 09:59:43.000000','开不了机','接上电源神奇的开着机器了，真神奇','张灼武','张灼武'),(836,'107','107','2010-06-17 10:00:33.000000','word打不开','中了U盘的文件夹病毒，所以文件都变成.EXE结尾，用贝壳木马专杀清理原病毒，后用autorun防御者来修复隐藏文件','张灼武','张灼武'),(837,'办公楼228','付老师','2010-06-17 10:08:15.000000','WORD打不开','<P>是打开得很慢，关闭STORM，如果弹出光驱WORD可以打开，他更换过光驱，他要求光盘自动播放，不影响的情况下没调</P>','周斌','周斌'),(838,'104','贾老师','2010-06-17 10:58:36.000000','进不了系统','到windows xp 账户登陆那里花屏后发现是显示卡问题，拔出显示卡重插就好了，更换显示卡驱动','张灼武','张灼武'),(839,'427','427','2010-06-17 10:59:35.000000