尘换槽插回就正常开机了','张灼武','张灼武'),(1066,'收发室','杨姐','2011-04-20 09:33:13.000000','开不了机，上不了网','开不了机，是内存问题，拔出擦干净灰尘插回就好，网络不通是因为IP绑定在另一个办公室。','张灼武','张灼武'),(1067,'414','414','2011-04-20 09:37:16.000000','无法播放视频文件','<P>因为电脑没安装相对应的解码播放器，下载QQ影音装上后就正常。</P>\r\n<P>问题1：HP开机有BB响报警的是因为，bios设置出问题，解决方法：按F10进入bios,选择菜单上的Advanced BIOS features 进去后选择菜单上的：first boo device 把 Removable 选择 Disabled</P>\r\n<P>问题2：HP Compaq DX2810/DX2818 商用台式电脑如何关闭增霸卡</P>\r\n<H2 class=ods_si_header>解决方案</H2>\r\n<DIV class=ods_si_para>\r\n<OL class=ods_si_list>\r\n<LI>\r\n<P class=ods_si_para>开机出现 HP logo 时，按 F10 进入到 BIOS 设置画面。</P>\r\n<LI>\r\n<P class=ods_si_para>选择Advanced菜单，回车。</P>\r\n<LI>\r\n<P class=ods_si_para>在Advanced菜单下，找到HP Network Clone ROM，将其状态设置成Disabled。</P>\r\n<LI>\r\n<DIV class=ods_si_para>保存设置，退出即可关闭增霸卡。 \r\n<DIV class=ods_note><SPAN class=ods_note_lbl>NOTE:</SPAN> 如果已经安装好增霸卡驱动，并且同传了系统，关闭增霸卡可能导致系统不能正常启动，关闭增霸卡前请首先确认是否必须做此动作。</DIV></DIV></LI></OL></DIV>','张灼武','张灼武'),(1068,'528','王老师','2011-04-21 16:34:47.000000','主机理线','换电脑桌，电脑重新整理线','张灼武','张灼武'),(1069,'办公楼122','陈老师','2011-04-25 14:39:45.000000','打印机有点问题','取消打印内容，重启后，只要用户2的灯不闪就正常','周斌','周斌'),(1070,'办公楼226','张老师','2011-04-25 14:41:06.000000','网络问题','桌面变成白色，SOGOU自动弹出信息框。','周斌','周斌'),(1071,'商学院519','徐老师','2011-04-26 09:30:26.000000','上不了网','<P>1.她本人使用的机器更换IP后正常</P>\r\n<P>2.另一台机器的网卡被禁用</P>','周斌','周斌'),(1072,'116','116','2011-04-27 09:14:41.000000','重装系统','系统运行速度很慢，电脑重新分区，安装系统。','张灼武','张灼武'),(1073,'办公楼229','陈老师','2011-05-04 09:46:56.000000','OA系统有问题','<P>OA弹出错误，修复IE后正常</P>','周斌','周斌'),(1074,'办公楼522','杨老师','2011-05-04 09:48:07.000000','网络较慢，经常断线','删除360，安装金山后，修复一下系弘让他试一下','周斌','周斌'),(1075,'办公楼142','曹老师','2011-05-05 10:42:09.000000','SOGOU出现乱码','删除SOGOU重装都不行，须将双拼改为全拼','周斌','周斌'),(1076,'商学院518','吕老师','2011-05-10 14:53:03.000000','上不了网','本地连接打X，网卡与网线接触不好，将网线向外拔一点就可以','周斌','周斌'),(1077,'教工宿舍431103','洪老师','2011-05-11 08:54:15.000000','上不了网','主线在电井未接，两种网线明显不同，应该是施工时未完工所致，在电井处接一个模块与水晶头即可','周斌','周斌'),(1078,'教工宿舍431001','郑老师','2011-05-11 14:18:29.000000','上不了网','楼下配线架