/*Table structure for table `memleave` */

DROP TABLE IF EXISTS `memleave`;

CREATE TABLE `memleave` (
  `id` int(10) NOT NULL,
  `name` varchar(50) NOT NULL,
  `hometown` varchar(50) DEFAULT NULL,
  `grade` varchar(50) NOT NULL,
  `profession` varchar(150) NOT NULL,
  `timeIn` varchar(50) NOT NULL,
  `timeOut` varchar(50) NOT NULL,
  `contact` varchar(150) DEFAULT NULL,
  `graduateWork` varchar(250) DEFAULT NULL,
  `offer` varchar(50) DEFAULT NULL,
  `comment` text,
  PRIMARY KEY (`id`),
  UNIQUE KEY `PK_memLeave` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

